	module.exports = {"author":"Subutai Ahmad","brief":"Did you ever think the Super Bowl could help you understand how your brain works? Numenta's core algorithm, the Cortical Learning Algorithmm (CLA) relies on the","date":"2013/01/27","featured":false,"image":"../images/image.jpg","org":"VP Research","tags":"Neuroscience, Machine Learning","title":"Introducing the first ever Sparse Football Pool!","body":"<h4>Win a Kindle Paperwhite and a copy of <em>On Intelligence</em></h4>\n<p>Did you ever think the Super Bowl could help you understand how your brain\nworks? Well, it can!</p>\n<p>Numentas core algorithm, the\n<a href=\"http://numenta.org/cla.html\">Cortical Learning Algorithmm</a> (CLA),\nrelies on the properties of Sparse Distributed Representations. SDRs are the\nfundamental way our brain represents information. The concepts behind SDR are\ndeep and thought provoking. We get a lot of questions around this and were\nwondering how to explain it all in a fun simple way.</p>\n<p>Enter the Sparse Football Pool. We came up with a simple Super Bowl quiz with\nrules that closely mimic some operations in the CLA. We hope the quiz will be\nfun and at the same time illustrate some deep principles behind the SDR.</p>\n<p>The rules are extremely simple.   How exactly do they relate to SDRs? Well\nexplain it all when we post the winner after the game, but for now here are two\ntidbits: 1) computing overlap is a fundamental operation with SDRs, and 2) when\nthere are 30 questions and you choose 9, there are 14,307,150\n<a href=\"http://www.calculatorsoup.com/calculators/discretemathematics/combinations.php\">possible combinations</a>\nof entries!</p>\n<p>Also, in order to have more people participate, were also offering a cool\nprize. The winner will receive a digital copy of\n<em><a href=\"http://www.amazon.com/On-Intelligence-ebook/dp/B003J4VE5Y/ref=sr_1_1?s=digital-text&amp;ie=UTF8&amp;qid=1359401193&amp;sr=1-1&amp;keywords=on+intelligence\">On Intelligence</a></em>\nas well as an Amazon\n<a href=\"http://www.amazon.com/gp/product/B007OZNZG0/ref=s9_simh_gw_p349_d2_i1?pf_rd_m=ATVPDKIKX0DER&amp;pf_rd_s=center-2&amp;pf_rd_r=01F8XD1MTXSPHDJF52RD&amp;pf_rd_t=101&amp;pf_rd_p=1389517282&amp;pf_rd_i=507846\">Paperwhite Kindle</a>.</p>\n<h4>The Three Rules:</h4>\n<ol>\n<li>\n<p>Answer TRUE or FALSE for each answer.</p>\n</li>\n<li>\n<p>You cannot have more than 9 TRUE answers. If you enter more than 9 TRUE\nanswers, we will take the first 9 only.</p>\n</li>\n<li>\n<p>To figure out the winner, we will compute the overlap score between the\nactual answers and your answer.  The person with the highest overlap score\nwill win.</p>\n</li>\n</ol>\n<h4>Computing Overlap Score</h4>\n<p>The overlap score simply gives you one point for every answer where you answered\nTRUE and the correct answer was TRUE.   For example, if the answer to question 3\nis True and you answered True, you get a point.    In all other cases you dont\nget a point for question 3. Note that since you can only put down 9 TRUEs, the\nmaximum overlap score you can get is 9.</p>\n<p>In case of ties, the earliest entry will win.  (Also, if you submit more than\none entry, only the last entry will count.) Full details are explained in the\n<a href=\"/legal/rules/sparse-football-pool-i-2013.html\">contest rules page</a>.\nOr feel free to post questions in the comment section below this blog post.</p>\n<h4>And Now, The Questions</h4>\n<p>To enter, go to our\n<a href=\"http://numenta.wufoo.com/forms/s7x2z7/\">online submission form</a>.\nYou will be asked to answer the following questions. They are repeated here for\nreference to help you plan out your answers ahead of time (responses will only\nbe accepted through the online submission form).</p>\n<p>The Baltimore Ravens will win the coin toss</p>\n<p>There will be a lead change in the first half</p>\n<p>There will be three lead changes in the game</p>\n<p>There will be no lead changes in the game</p>\n<p>The team leading at the end of the first half will lose the game</p>\n<p>Colin Kaepernick will have at least one run greater than 20 yards</p>\n<p>Joe Flacco will have at least one pass greater than 40 yards</p>\n<p>Ray Lewis will get more tackles than Patrick Willis (solo + assisted)</p>\n<p>Patric Willis will get more tackles than Ray Lewis (solo + assisted)</p>\n<p>Aldon Smith will finally get a sack in the playoffs</p>\n<p>Frank Gore will rush for more yards than Ray Rice</p>\n<p>Ray Rice will rush for more yards than Frank Gore</p>\n<p>There will be a scoreless quarter</p>\n<p>There will be more than 10 total points in the first half</p>\n<p>Baltimore will score first</p>\n<p>San Francisco will score first</p>\n<p>There will be a punt or kickoff return that is greater than 40 yards</p>\n<p>Joe Flacco will have a higher QB Rating than Colin Kaepernick</p>\n<p>Colin Kaepernick will have a higher QB Rating than Joe Flacco</p>\n<p>The longest field goal will be more yards than the longest offensive play</p>\n<p>There will be a score in the final 2 minutes of the first half</p>\n<p>There will be a score in the final 2 minutes of regulation</p>\n<p>Frank Gore will score the first touchdown</p>\n<p>Vernon Davis will score a touchdown</p>\n<p>Ray Rice will score a touchdown</p>\n<p>The San Francisco Forty Niners claim their 6th Superbowl Trophy!</p>\n<p>The Baltimore Ravens claim their 2nd Superbowl Trophy!</p>\n<p>The color of the Gatorade dumped on the winning coach will be orange</p>\n<p>JZ will join Beyonce on stage at some point during the halftime show</p>\n<p>There will be a Beyonce lip-sync controversy reported on <a href=\"http://ESPN.com\">ESPN.com</a> within an hour\nafter the game ends.</p>\n<p>Once again, heres the link to the <a href=\"http://numenta.wufoo.com/forms/s7x2z7/\">online submission\nform</a>.</p>\n"}

