	module.exports = {"author":"Rob Haitani","brief":"Thanks to everyone for participating in the Sparse Football Pool!  It was a tight race that, given the game, went down to the wire.  The winner had a total","date":"2013/01/29","featured":false,"image":"../images/image.jpg","org":"Marketing","tags":"Neuroscience, Machine Learning","title":"Sparse Football Pool Winner","body":"<p>Thanks to everyone for participating in the Sparse Football Pool!  It was a\ntight race that, given the game, went down to the wire.  The winner had a total\nof 7 correct responses, which is impressive given that you were only allowed to\nselect 9.</p>\n<p>In fact, there were two entries with the highest score. But given the rules of\nthe contest, the first entry wins the Kindle and copy of <em>On Intelligence</em>.  And\nthat winner is:</p>\n<p>Ryan McCall!</p>\n<p>Congratulations!  Ryan also beat the best entry from Numenta (we were not\nallowed to win the public prize but wanted to see how wed do, since our\nparticipation wouldnt affect the public winners chances). The top two Numenta\nentries had 6 correct answers.</p>\n<p>To see how you did, you can\n<a href=\"/legal/results/sparse-football-pool-i-2013.html\">check out the results page</a>.</p>\n<p>We will follow up with a blog post describing how this pool relates to the way\nthe brain stores data. But in the meantime, thank to everyone for participating,\nand congratulations again Ryan!</p>\n<p>If only the Niners had won the game ;^)</p>\n"}

