	module.exports = {"author":"Jeff Hawkins","brief":"I am often asked, \"Is Numentas Cortical Learning Algorithm a neural network?\" The short answer to this question is \"Yes,\" but the problem with this short","date":"2013/02/19","featured":false,"image":"../images/main.jpg","org":"Founder","tags":"Machine Learning, Neuroscience","title":"Not Your Father's Neural Network","body":"<p><img src=\"../images/main.jpg\" alt=\"Image\" title=\"CLA Neuron\"></p>\n<p>I am often asked, Is Numentas\n<a href=\"http://numenta.org/cla.html\">Cortical Learning Algorithm</a> a\n<a href=\"http://en.wikipedia.org/wiki/Neural_network\">neural network</a>?\n(For those who dont know, the Cortical Learning Algorithm, or CLA, is the\nheart of Grok our streaming data product.)</p>\n<p>The short answer to this question is Yes, but the problem with this short\nanswer is that the Cortical Learning Algorithm is quite different than what most\npeople think of as a neural network.</p>\n<p>The history of artificial neural networks starts with\n<a href=\"http://en.wikipedia.org/wiki/Warren_McCulloch\">Warren McCulloch</a> and\n<a href=\"http://en.wikipedia.org/wiki/Walter_Pitts\">Walter Pitts</a>.  In 1943 they were\nthe first to propose creating networks of\n<a href=\"http://en.wikipedia.org/wiki/Artificial_neuron\">artificial neurons</a>. They\nshowed that artificial neurons could act like logic gates (AND, OR, etc.) and by\nconnecting them in precise ways we could implement any digital logic. It was\nground breaking work but biologically unrealistic.</p>\n<p>Neural networks remained a minor research area for many years until they\nresurfaced in a big way in the 1980s.  This was partly due to the rediscovery of\n<a href=\"http://en.wikipedia.org/wiki/Backpropagation\">back propagation</a>, which is a\nmethod of training simple neural networks, and it was partly due to a two volume\nbook called\n<em><a href=\"http://mitpress.mit.edu/books/parallel-distributed-processing\">Parallel Distributed Processing</a>.</em>\nThe PDP books ignited interest in the field.  At this time I was already\nconvinced that the path to machine intelligence required understanding how the\nbrain works so I welcomed the new interest in neural networks.  Up to that\npoint in time, symbolic and engineered approaches to A.I. were the dominant\napproaches to machine intelligence.</p>\n<p>However, I quickly became disillusioned with the new neural networks.  The\nbiggest problem was they ignored time.  Brains process flowing streams of\nsensory data.  All inference, prediction, and motor behavior in a brain is built\nupon memory of sequences of patterns.\nThe vast majority of artificial neural networks completely ignored time and\nhence were unable to process changing inputs or generate behavior.  Without\nembracing temporal patterns I felt we would not get close to capturing\nintelligence.</p>\n<p>There were other problems with the simplistic neural networks of the 1980s.\nBiological neurons have thousands or tens of thousands of synapses arranged on\ndendrites which have non-linear properties; artificial neurons typically had\njust a few synapses on a cell body and ignored dendrite properties.  Biological\nneural networks have detailed prototypical architectures; artificial neural\nnetworks ignored these architectures. Neuroscience was starting to develop\noverall theories of brain function but artificial neural networks were simple\nclassifiers that didnt fit within an overall theory.  Basically, for many years\nmost artificial neural network research ignored neurobiology and their\napplications remained limited to simple classification.  When most people think\nof artificial neural networks they think about the type of neural networks\nexplored in the 1980s.</p>\n<p>Today the term artificial neural network can refer to many different types of\nnetworks.  Some strive for biological realism and some dont.  So when I am\nasked if Numentas Cortical Learning Algorithm is a neural network, I reply\n&quot;Yes, but there many types of neural networks.  If you want to compare the CLA\nto other neural networks, ask do those other networks learn sequences, do they\nlearn in an on-line fashion, do they incorporate neurons that have non-linear\ndendrites, do they form thousands of connections, does the architecture of the\nnetwork reflect the known architecture of any part of the brain, and does the\nnetwork fit within a larger theory of brain function?&quot;  The number of artificial\nneural networks that fit these criteria is small.  The CLA is one of them.</p>\n<p>BTW, there is one type of early artificial neural network that was applied to\nsequences.  These are called auto-associative memories.  In another blog post I\nwill describe how the CLA and auto-associative memories are related.</p>\n<blockquote>\n<p>Jeff Hawkins</p>\n</blockquote>\n"}

