	module.exports = {"author":"Joe Hayashi","brief":"A question we get from time to time is, How is Grok different from complex event processing systems?  Like Grok, CEP systems are all about streaming data","date":"2013/04/02","featured":false,"image":"../images/image.jpg","org":"Marketing","tags":"Company, Data","title":"Numenta and Complex Event Processing","body":"<p>A question we get from time to time is, How is Grok different from complex\nevent processing systems?  Like Grok, CEP systems are all about streaming data,\nbut Numenta and CEP systems use this data in different ways. We think Numenta\nand CEP are highly complementary and I wanted to take a moment to explain why.</p>\n<p>A key capability of CEP systems is that they can perform database-like\noperations on streaming data - queries, joins, aggregations, mathematical\noperations, etc.  As data comes in, the results of these operations are\ncontinuously updated. Need an instantaneous summary of your firms market\npositions? Need to know what the current load is on your cell sites? CEP systems\nare built to answer these types of questions and to do it continuously.</p>\n<p>The second hallmark of CEP systems is triggering action. Knowing that your house\nis on fire is certainly important, but you really want to take action to put out\nthe fire. CEP systems also allow you to create business logic around streaming\ndata and then drive action from it.  If a real-time key performance indicator is\nexceeded, logic can be written in the CEP system to trigger a response and take\naction.</p>\n<p>This combination of capabilities - working with real-time data and creating a\nframework of logic around it - enable many companies to set aside legacy code\nbases for more flexible CEP environments.  Because of this flexibility, you\noften find CEP systems at the heart of many real-time operational systems.</p>\n<h4>Grok extends CEP into the future</h4>\n<p>As we implement pilot projects with customers who use CEP, weve come to\nappreciate how Grok can be a powerful and valuable extension to their CEP\ndeployments.</p>\n<p>In a nutshell, Grok makes it easy to get predictions from and find anomalies in\ndata streams. Its certainly helpful to know what is happening now, but the next\nlogical question to ask is, what will happen next?</p>\n<p><img src=\"../images/cep-arrow.jpg\" alt=\"Image\" title=\"Numenta and CEP Systems\"></p>\n<p>The simple view is that business intelligence systems are focused on historical\ndata, CEP systems focus on what is happening right now, and Grok is focused on\nwhat is most likely to happen in the future.</p>\n<h4>Real-time prediction</h4>\n<p>One of the pillars of Grok is its ability to develop high quality predictive\nmodels automatically.  Data streams being used by a CEP system can be trivially\nrepurposed to build predictive models of the data.  The predictions from the\nGrok models can then be easily brought back into the CEP environment.</p>\n<p>No doubt youve heard that building good enterprise scale predictive models can\nbe hard for us humans.  When you have thousands of data streams and you want to\nalways use the latest information, it becomes even more challenging. Grok can\nbuild custom models for each data stream and do it automatically in a way that\nis always up to date.</p>\n<p>Grok can provide customers with CEP systems with high quality predictions about\nwhat is most likely to happen and this information can be added to the mix of\noperational information to make the best decision and take the most appropriate\nactions.</p>\n<h4>Move from hand-built triggers to adaptive modelling</h4>\n<p>In addition to modelling many data streams automatically, Grok can also make the\nbusiness logic that drives the action from CEP systems much more flexible and\nadaptive.</p>\n<p>Many CEP applications look at thresholds of real time data and when these\nthresholds are violated, actions are triggered. One problem is that it can be a\ntedious and error prone task to configure these thresholds. But the real problem\nwith thresholds (even moving thresholds) is what what was normal yesterday\nisnt normal today. Businesses operate in a world that is constantly evolving\nand your systems cant be hard-coded to the past.</p>\n<p>Grok models learn continuously from data. Even when Grok is looking for\nanomalies, its models can adapt to find the new normal in your data, while\nstill recognizing important historical anomalies.  This adaptive behavior, when\npaired with CEPs ability to act on data, is required if you want to drive\nintelligent action from your operational data.</p>\n<p>With Groks focus on streaming data, automated model building, and continuous\nlearning, we believe that Grok is an ideal match for CEP applications in\nfinance, energy, and telecommunications.</p>\n<p>I should mention that there are a number of excellent CEP system on the market,\nproducts like <a href=\"http://bit.ly/13P4QF6\">Oracle OEP</a>,\n<a href=\"http://bit.ly/14CJutu\">Sybase ESP</a>,\n<a href=\"http://ibm.co/12dbr7a\">IBM InfoSphere Streams</a>, and others.  Well be talking\nmore about Groks fit with these and other products in the coming weeks.</p>\n"}

