	module.exports = {"author":"Donna Dubinsky","brief":"For a company that is launching its first product, we have an unusual number of terms and names, including Numenta, Grok, HTM, and NuPIC. This abundance of names reflects our unusual mission.","date":"2014/03/17","featured":false,"image":"../images/image.png","org":"CEO","tags":"numenta, name, change, grok","title":"Navigating Names at Numenta","body":"<p>For a company that is launching its first product, we have an unusual number of\nterms and names, including Numenta, Grok, HTM, and NuPIC. This abundance of\nnames reflects our unusual mission. Im writing this blog post to explain how\nall these names fit together.</p>\n<p>Our company was founded over nine years ago as Numenta, and we are returning to\nusing this as our company name. Numentas mission is to <strong>lead the new era of\nmachine intelligence</strong>. This mission is ambitious, but its one that we are proud\nof and deeply committed to, and we have made real progress towards its\nachievement. The origin of the word is from the Latin mentis, meaning mind,\nso a new mind.</p>\n<p>In order to understand and make practical our machine intelligence technology,\nwe now are building products on top of it. Consequently, Numenta is both a\ntechnology and a product company. We are using the name Grok for our first\ncommercial product. We just launched Grok for IT Analytics on AWS (Amazon Web\nServices). We anticipate creating a variety of Grok products over time, all of\nwhich will use our core machine intelligence technology, but include additional\nfunctionality targeted at specific customer problems or domains. Our goal with\nGrok and other products is to become the leading platform for machine\nintelligence.</p>\n<p>Once you look deeper into the technology behind Grok and our other applications,\nyou will want to understand where the acronyms fit in. The broad theory\ndescribed by Jeff Hawkins in his book, On Intelligence, is called Hierarchical\nTemporal Memory (HTM). HTM is a theory about key characteristics of neocortex,\ndescribing learning as a memory-prediction system operating on spatio-temporal\ndata. HTM forms the theoretical underpinnings for our work. The learning\nalgorithms within HTM learn sequences and find patterns in temporal data. These\nHTM learning algorithms are modeled very closely after biological principles,\nand can be mapped to a single layer of neurons in the cortex.</p>\n<p>In 2013, we created an open source project implementing HTM in order to further\nour mission of being a leader in the new era of machine intelligence. We refer\nto the open source project as NuPIC (Numenta Platform for Intelligent\nComputing), and it is hosted at <a href=\"http://numenta.org\">http://numenta.org</a>.</p>\n<p>So, thats all there is to it! In brief:</p>\n<table>\n<thead>\n<tr>\n<th>Name</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Numenta, Inc.</td>\n<td>Company name, including both technology and products</td>\n</tr>\n<tr>\n<td>Grok</td>\n<td>Name for first commercial product, Grok for IT Analytics</td>\n</tr>\n<tr>\n<td>Hierarchical Temporal Memory (HTM)</td>\n<td>Theory of neocortex described by Jeff Hawkins in On Intelligence.  Includes learning algorithms that find patterns in streaming data, predict next steps, and find anomalies; a core building block for HTM.</td>\n</tr>\n<tr>\n<td>NuPIC (Numenta Platform for Intelligent Computing)</td>\n<td>Open source project where HTM is being explored and advanced by the developer community</td>\n</tr>\n<tr>\n<td><a href=\"http://numenta.org\">http://numenta.org</a></td>\n<td>The home for NuPIC, the open source project</td>\n</tr>\n<tr>\n<td><a href=\"http://numenta.com\">http://numenta.com</a></td>\n<td>The home for Numenta, the company, and the Grok product</td>\n</tr>\n</tbody>\n</table>\n<p>As I said up front, Numenta is an unusual company. We work with scientists who\nare mainly interested in the HTM theory. We work with developers who are mainly\ninterested in our open source project using HTM. And we work with customers who\nare mainly interested in the Grok product built on top of these technologies,\nand prefer to think of the underlying technology as a black box. By using\nterminology to differentiate these audiences, it makes life a bit more complex\nfor us, but we believe that it makes our work and our direction far more clear.</p>\n"}

