	module.exports = {"author":"Jared Casner","brief":"Like most engineering managers, I like to know when someone is manually touching one of our servers. Thats especially true for production systems, but also","date":"2014/04/22","featured":false,"image":"../images/image.png","org":"Director, Product Development","tags":"science, anomaly, detection, grok, aws","title":"Caught Red Handed","body":"<p>Like most engineering managers, I like to know when someone is manually touching\none of our servers.  Thats especially true for production systems, but also\napplies to QA servers.  So, imagine my chagrin when Grok caught me red handed,\nnot just once, but twice this week!</p>\n<p><img src=\"../images/1.png\" alt=\"Grok Screenshot\" title=\"Grok Screenshot\"></p>\n<p><img src=\"../images/2.png\" alt=\"Grok Screenshot\" title=\"Grok Screenshot\"></p>\n<p>This first example was when I upgraded one of our QA servers to Grok 1.3\n(shameless plug  thats available now in the <a href=\"/grok/#get\">AWS marketplace</a> !)\nIn this example, you can see a very slight increase in the number of bytes\nreceived by the server, which was flagged very quickly.  At the same time, the\nCPU utilization starts to drop slightly, which Grok marked as yellow. Notice\nthat Grok picked up the update on 2 metrics at the same time, both right as the\nprocess starts, before the metrics get into ranges that could be identified as\nabnormal by most statistical techniques!  Having a leading indicator  even by a\nfew minutes  that things are starting to behave atypically is a huge advantage!</p>\n<p>Luckily for us, this was a totally innocuous change.  And, investigation was\neven easier because when I got the alert about the anomaly, I was still in the\nmiddle of the update.</p>\n<p>The second example from this week was when I decided doing some recovery testing\nwould be a good idea.  I manually stopped all of the services on the QA server\nand watched the CPU load drop rapidly again.  This time, Grok picked up the\nchange very rapidly.  But, notice that the new pattern also stabilizes very\nquickly at ~20% CPU load, with the Grok anomaly score dropping back into the\ngreen quickly.  Grok then flags an anomaly around 12 hours later when I turned\nthe services back on and the CPU jumped back up to the ~85% mark.  Now, if\nyoure like me, youll have noticed a 3rd anomaly in the chart on the left,\nright around 10PM.  I drilled into that one and noticed that, sure enough, the\npattern is just slightly different at 10PM than it is at 9PM.  Its a visibly\nsubtle difference, but important nonetheless.</p>\n<p><img src=\"../images/3.png\" alt=\"Grok Screenshot\" title=\"Grok Screenshot\"></p>\n<p><img src=\"../images/4.png\" alt=\"Grok Screenshot\" title=\"Grok Screenshot\"></p>\n<p>Stay tuned for our next Anomaly of the Week!</p>\n"}

