	module.exports = {"author":"Viraj Sinha","brief":"I decided to apply Grok and the Cortical Learning Algorithm to stock data: have the CLA learn patterns and alert me to anomalies. I decided to monitor volume","date":"2014/07/15","featured":false,"image":"../images/image.png","org":"Summer Intern, Engineering","tags":"anomaly, detection, stock, finance, volume","title":"Detecting Anomalies in Stock Volumes","body":"<p>In the film Pi, a mathematician by the name of Maximllian Cohen derives the\nmathematics for universal prediction pattern in stock data (using, as the\nmovies namesake may suggest, the number Pi). With his math, Max is able to\npredict the precise activity of the market, in real time. The movie takes a turn\nfor the cerebral (and is worth a watch), but the idea of predicting stock data\nstuck with me. Rather than using Maxs math, I decided to apply Grok and the\nCortical Learning Algorithm to stock data: have the CLA learn patterns and alert\nme to anomalies.</p>\n<p>I decided to primarily monitor stock volume, which can be an interesting\nindicator of a shares performance. Usually, a drastic event in volume indicates\na change in the recent trend of a given share: a volume spike signifies interest\nby investors (or trading algorithms), often related to buy orders when the price\nis significantly low, or sell orders when the price is high. By using Grok to\nmonitor volume anomalies, I can get a notification on my phone when a given\nshare is being traded in an unusual way.</p>\n<p>Trade volume often peaks towards the beginnings and ends of the day, as after-\nhours orders are filled in the mornings, or as close-price orders are filled in\nthe evening. Since Grok actually learns the patterns rather than being a simple\nthreshold-based system, it does very well learning patterns and filtering the\nsignal from the noise.</p>\n<p><img src=\"../images/1.png\" alt=\"Google Finance Graph\" title=\"Google Finance Graph\"></p>\n<p>Heres a real life example from the ticker for 3D Systems Corporation (DDD). 3D\nSystems Corporation builds and sells 3D printers and scanners, as well as sells\n3D printed parts to everyone from the automotive to the dental and healthcare\nindustries. In the first image (taken directly from Google Finance), we can see\na trade volume spike on July 1st just moments before a huge increase in price\n(and a continued increase in trade volume). In the second (taken from Grok), we\nsee an anomaly detected with the volume spike! When this happened, I got a\nnotification sent to my phone, telling me to check out DDDs anomalous behavior.\nI quickly got online and watched the action live, as the price skyrocketed and\nthen dropped back down. If Id actually had DDD in my portfolio, I wouldve\nknown that the price spiked, and wouldve seen it drop back down by the end of\nthe day. Its very convenient to be told when a share is doing something like\nthis, rather than having to watch multiple prices during the day.</p>\n<p><img src=\"../images/2.png\" alt=\"Grok Anomaly Chart\" title=\"Grok Anomaly Chart\"></p>\n<p>Interestingly, we dont see any anomalies after the first red peak on the\nanomaly chart. This is because Grok, by default, suppresses additional anomalies\nfor an hour after an initial detectionthe red peak on the chart is synonymous\nwith a detected anomaly. Since Grok fires off a cell phone notification every\ntime it sees an anomaly, we decided we didnt want to spam the user with\nmultiple notifications within a certain time period. If you look closely at the\ngraph, you can even see the perfectly flat section for about 1 hour after the\ninitial red anomaly. If we didnt have this suppression turned on, wed expect\nto see additional anomalies detected around 8:40 and 9:05 that day.</p>\n<p>Im writing this post a week after this event, and the press has had some time\nto catch up. There are a few speculative reasons for this price spike, including\na change in management [1], the launch of a new 3d scanner for the iPad [2], and\nnews of recent advancements in medical-grade 3D printing which will allow for\nantibiotic-infused implants [3]. This is pretty exciting news, all of which I likely\nwouldnt have noticed if it werent for Grok.</p>\n<p>[1] <a href=\"http://www.marketnewscall.com/volume-buzzers-3d-systems-corporation-nyseddd-ezchip-semiconductor-ltd-nasdaqezch/1231261/\">http://www.marketnewscall.com/volume-buzzers-3d-systems-corporation-nyseddd-ezchip-semiconductor-ltd-nasdaqezch/1231261/</a></p>\n<p>[2] <a href=\"http://www.gaininggreen.com/computer-peripherals-3d-systems-corporation-nyseddd-logitech-international-sa-nasdaqlogi-electronics-for-imaging-nasdaqefii-universal-display-corporation-nasdaqoled-transact-technolog/1239893/\">http://www.gaininggreen.com/computer-peripherals-3d-systems-corporation-nyseddd-logitech-international-sa-nasdaqlogi-electronics-for-imaging-nasdaqefii-universal-display-corporation-nasdaqoled-transact-technolog/1239893/</a></p>\n<p>[3] <a href=\"http://3dprint.com/7793/3d-print-antibiotics-implants/\">http://3dprint.com/7793/3d-print-antibiotics-implants/</a></p>\n"}

