	module.exports = {"author":"Nick DeFalco","brief":"On the other hand, HTM machine intelligence  like your brain  comprises a single underlying processing method that is extensible across a wide range of applications. Over the course of this summer alone, we have used our underlying","date":"2014/08/11","featured":false,"image":"../images/image.png","org":"Marketing Intern","tags":"summer internships hierarchical temporal memory htm extensible","title":"Summer Internships and the Extensibility of HTM","body":"<p>I recently had a conversation with a friend where the subject of our summer\ninternships came up. My friend is interning at a financial institution and she\nhad great things to say about her company and the people she worked with.\nHowever, her one major complaint was that the work she did was very specialized\nand narrowly focused. She worried that if she ultimately decided to pursue a\ncareer outside of finance, the skills she had sharpened during her internship\nwouldnt be widely applicable.</p>\n<p>To me, this sounded like the opposite of what I felt about my time with Numenta.\nAs more than one of my old bosses used to say, working in a startup is like\nbuilding the airplane as youre heading down the runway. In a situation like\nthis, roles are somewhat amorphous, projects are fast paced, and coworkers\ncontribute wherever they can. Furthermore, the skills and mindset developed in\nthis type of environment are relevant across a wide range of functions.</p>\n<p>As I think back on the conversation I had with my friend, I realize that the\ndifferences between her internship experience and my own also provide a strong\nmetaphor for comparing the Hierarchical Temporal Memory (HTM) machine\nintelligence technologies we are developing at Numenta against the typical\nprogrammed tools we are all familiar with today. Almost all of the software we\nuse today has been programmed to do one specific set of tasks. This enables each\nindividual program to perform the jobs it was designed for extremely well, but\nlimits the usefulness of each tool to a very limited range of use cases. Thats\nwhy you only need one brain, but your smart phone would be pretty dumb if you\nonly had one app.</p>\n<p>On the other hand, HTM machine intelligence  like your brain  comprises a\nsingle underlying processing method that is extensible across a wide range of\napplications. Over the course of this summer alone, we have used our underlying\nmachine intelligence technology to deliver interesting new capabilities across a\nwide variety of potential applications and data sets. Here are a few of the\napplications that we have been working on this summer to demonstrate the\nextensibility of HTM:</p>\n<h4>Rogue Behavior Detection</h4>\n<p>Using the data generated by human actions to alert to abnormal employee actions\nand detect when computers or other devices are accessed by unauthorized users.</p>\n<p><img src=\"../images/rogue.png\" alt=\"Screenshot\" title=\"Screenshot\"></p>\n<h4>Geospatial Tracking</h4>\n<p>Using streaming GPS and speed data to automatically model location and travel\npatterns, then use this model to identify subsequent irregularities in speed,\nlocation and route pattern.</p>\n<p><img src=\"../images/geo.png\" alt=\"Screenshot\" title=\"Screenshot\"></p>\n<h4>Natural Language Processing</h4>\n<p>Improving the ability of machines to understand the semantic meaning and context\nof natural language.</p>\n<p><img src=\"../images/nlp.png\" alt=\"Screenshot\" title=\"Screenshot\"></p>\n<h4>Sensorimotor Learning and Prediction</h4>\n<p>Actively exploring an environment to:</p>\n<ol>\n<li>Predict the results of motor actions and control signals, and</li>\n<li>Form stable and discriminative representations of each environment</li>\n</ol>\n<p><img src=\"../images/motor.png\" alt=\"Screenshot\" title=\"Screenshot\"></p>\n<p>Just as the tools used during an internship only represent a few of the gadgets\nwe each hold in our tool bags, the applications shown above only demonstrate a\nthin slice of the potential that HTM machine intelligence holds. As such, Im\nreally excited to see how HTM will continue to grow over the next few years to\ndeepen its capabilities and broaden the ways in which it impacts our world.</p>\n"}

