	module.exports = {"author":"Donna Dubinsky","brief":"Late last year we shipped our first product, Grok for IT Analytics on AWS. Since then, weve released several enhancements for the product, including the recent version 1.5 with a new web charting feature.","date":"2014/08/18","featured":false,"image":"../images/image.png","org":"CEO","tags":"progress numenta grok htm aws it analytics anomaly detection streaming data","title":"Progress at Numenta","body":"<p>You will notice some substantial changes in our web site this week.  Id like to\ntake a moment to explain whats going on.</p>\n<p>Late last year we shipped our first product, <a href=\"http://grokstream.com\">Grok for IT Analytics</a>\non AWS. Since then, weve released several enhancements for the product,\nincluding the recent version 1.5 with a new web charting feature.</p>\n<p>Some customers using our product have told us that they have found problems in\ntheir AWS environments that other methods havent caught, while others have\nfound problems hours earlier than they would have otherwise.  These results have\ndemonstrated that our HTM (Hierarchical Temporal Memory) learning algorithms are\nperforming as we had hoped.  We are automatically learning the patterns in the\nstreaming data of each individual server, and then finding when the input\ndiffers from that expected, thus detecting an anomaly.  Other customers are also\nusing Grok to analyze non-IT data using our\n<a href=\"/assets/pdf/grok/resources/1.3/Grok-Custom-Metrics.pdf\">custom metrics feature</a> -\nwith interesting results.  We encourage you to explore this option and would\nlove to hear about your results.</p>\n<p>While we will continue to evolve the Grok for IT Analytics product, we are\nequally excited about myriad opportunities to apply this technology to other\ndomains.  As a result, over the past few months we have turned our attention\ntowards creating demonstration applications that show how to potentially apply\nour HTM technology to a variety of other problems.</p>\n<p>We have restructured our web site to better communicate the breadth of our\ntechnology.  Detailed information on <a href=\"http://grokstream.com\">Grok for IT Analytics</a>\nis still available, but now if you come to visit Numenta, you first will see\ninformation on Numenta technology, before diving deeper to learn more about Grok\nand other applications.</p>\n<p>As part of the evolution of our web site, we have created some new material that\nwe hope you will read:</p>\n<ul>\n<li><a href=\"/assets/pdf/whitepapers/Rogue%20Behavior%20Detection%20White%20Paper.pdf\">Whitepaper: HTM for Rogue Behavior</a></li>\n<li><a href=\"/assets/pdf/whitepapers/Geospatial%20Tracking%20White%20Paper.pdf\">Whitepaper: HTM for Geospatial Tracking</a></li>\n</ul>\n<p>These whitepapers show how the same core technology that finds anomalies in\nGrok for IT also finds anomalies in other, very different, streams of data.  In\neach case, our HTM learning algorithms are automatically modelling different\ntypes of streaming data, learning the patterns, predicting what should come\nnext, and then highlighting inputs that differ from those predicted.  In other\nwords, our algorithms are doing what your brain does, day in and day out.</p>\n<p>We hope youll enjoy our new look and refreshed content and look forward to your\nfeedback.</p>\n"}

