	module.exports = {"author":"Subutai Ahmad","brief":"I am pleased to tell you about a change we recently made to our research process. We have made our day to day experimental code public. We've already released our commercial HTM algorithm code to the","date":"2014/09/17","featured":false,"image":"../images/image.png","org":"VP Research","tags":"increasing research transparency numenta nupic machine intelligence","title":"Increasing Research Transparency","body":"<p>I am pleased to tell you about a change we recently made to our research\nprocess. We have made our day to day experimental code public.</p>\n<p>As you may know, we already released our commercial HTM algorithm code to the\nNuPIC open source community in the form of the\n<a href=\"http://numenta.org\">NuPIC project</a>. We use that exact codebase in our product\nGrok. The <a href=\"http://numenta.org/community.html\">NuPIC open source community</a> and\nNumenta actively work together to continually maintain and improve this code\nbase.</p>\n<p>Within Numenta we continue to evolve and expand HTM theory. Our goal is to\ncreate a complete cortical theory and codebase, including such topics as\nsensorimotor integration, attention, hierarchy, and others. Our research ideas\nare constantly in flux as we tweak and experiment. To support the research we\nhave, up until today, maintained a separate internal codebase that sits on top\nof NuPIC.</p>\n<p>Interest in HTM has grown tremendously and we get many questions about our\nresearch. Over the last few months we have openly discussed fundamental ideas\naround sensorimotor inference, temporal pooling, hierarchy, etc. on the\n<a href=\"https://discourse.numenta.org/c/htm-theory\">HTM Theory Forum</a>.\nNumerous people in the NuPIC community have been actively engaged in deep\ntheoretical discussions.</p>\n<p>Given this interest we wondered whether it would be possible to be more open\nabout our work. What if we released our day-to-day research code to a public\nrepository? There are potential downsides. Research code can be very rough -\nwould people get confused? Would they become discouraged or even skeptical about\nthe theory if what they see is not yet working? We might get many questions\nabout it - would that slow us down? On the other hand, exposing our work-in-\nprogress would give members of the community visibility as to our priorities,\nhelp them understand more deeply the theory, and create an opportunity to\nsolicit their ideas and improvements.</p>\n<p>We floated the idea and discussed the tradeoffs with the NuPIC developer\ncommunity. The feedback we received gave us the confidence to proceed. Im\nhappy to share that we just created an experimental public\n<a href=\"https://github.com/numenta/nupic.research\">nupic.research</a> repository on\nGitHub. This directory is small right now, but active. The code includes our\ncurrent prototypes and experiments around sensorimotor inference.</p>\n<p>I do want to emphasize one point; this is not code we push only after things are\nworking well. This is code as we are working on it. We make regular pull\nrequests and check-ins. We use GitHub to track our day to day tasks, and it\ncontains our internal conversations about the code. It provides an almost real\ntime view into the research being performed at Numenta.</p>\n<p>This change is an experiment in conducting research in the open. We dont know\nhow it will turn out. If this idea works out well, over time the repository will\ngrow to contain just about all our research code. If not, well, well just stop\ndoing it. Its all in the spirit of research!</p>\n<p>P.S. There is some fine print. This code is all temporary and experimental. We\ncant make any guarantees about it. Currently we are not accepting pull\nrequests, though this might change down the road. However you are free to copy\nand use it under the terms of the AGPL license<sup><a href=\"#agpl\">*</a></sup>. Please see the README file on\nGitHub for more fine print and details.</p>\n<p><small id=\"agpl\" class=\"disclaimer\"><sup>*</sup> This content has been updated to reflect our <a href=\"http://numenta.org/blog/2015/08/17/licensing-update.html\">new AGPL license</a>.</small></p>\n"}

