	module.exports = {"author":"Joe Block","brief":"Using the burnrate custom metrics script with your Grok server","date":"2014/12/15","featured":false,"image":"../images/image.png","org":"Site Reliability Engineer","tags":"grok aws ec2 custom metrics burn rate numenta machine intelligence","title":"Monitoring AWS EC2 Burnrate with Grok","body":"<p><strong>NOTE:</strong> Numenta has <a href=\"/press/numenta-announces-licensing-of-grok-for-it-to-avik-partners.html\">announced a strategic partnership with Avik Partners</a>,\nplease read more about the future of\n<a href=\"http://grokstream.com\">Grok for IT Analytics</a>.</p>\n<p>A few months ago, we mentioned that were monitoring our AWS EC2 costs with\nGrok. We developed a simple script to monitor our burnrate and ensure that when\nour spend changed, we knew about it and could take action.  Since we posted\n<a href=\"/blog/grok-for-managing-aws-cost-anomalies.html\">Grok For Managing AWS Cost Anomalies</a>,\nweve had requests for more details and for access to the script.</p>\n<p>Today were happy to announce that the script is available on Github at\n<a href=\"https://github.com/groksolutions/grok-burnrate\">https://github.com/groksolutions/grok-burnrate</a>.\nYou can run it as a standalone script or with Docker using the Dockerfile\nthere or by pulling from the public Docker registry.</p>\n"}

