	module.exports = {"author":"Numenta","brief":"Around this time of year the US goes crazy over the Super Bowl. So be it, but did you ever think the Super Bowl could help you understand how your brain works? Well, it can!","date":"2015/01/22","featured":false,"image":"../images/image.jpg","org":"Subutai Ahmad & Ryan McCall","tags":"sparse football pool ii 2015 super bowl xlix sdr sparse distributed representation htm","title":"Introducing Sparse Football Pool II","body":"<p>Around this time of year the US goes crazy over the Super Bowl. So be it, but\ndid you ever think the Super Bowl could help you understand how your brain\nworks? Well, it can!  Enter the Sparse Football Pool.</p>\n<p>Numentas theory of the cortex,\n<a href=\"/#technology\">Hierarchical Temporal Memory</a>,\nrelies on the properties of Sparse Distributed Representations. SDRs are the\nfundamental way our brain represents information. The concepts behind SDR are\ndeep and thought provoking. We get a lot of questions around this and were\nwondering how to explain it all in a fun simple way.</p>\n<p>We came up with a simple Super Bowl quiz with rules that closely mimic some\noperations in HTM. We hope the quiz will be fun and at the same time illustrate\nsome deep principles behind SDRs.</p>\n<p>The rules are extremely simple. How exactly do they relate to SDRs? Well\nexplain it all when we post the winner after the game, but for now here are two\ntidbits: 1) computing overlap is a fundamental operation with SDRs, and 2) when\nthere are 30 questions and you choose 11, there are 54,627,300 possible\ncombinations of entries. The chance of getting all 11 correct is pretty small,\nbut given how improbably the Seahawks won their game anything is possible!</p>\n<h4>WIN AN AUTOGRAPHED COPY OF ON INTELLIGENCE</h4>\n<p>Were offering some cool prizes (US citizens 18 and over only). The top 5\nwinners will receive a Numenta T-shirt and an autographed hardcover of On\nIntelligence. In addition the winner will receive a $100 gift certificate to\nAmazon, iTunes, or Google Play (their choice).</p>\n<h4>THE THREE RULES</h4>\n<ol>\n<li>Answer TRUE or FALSE for each answer.</li>\n<li>You cannot have more than 11 TRUE answers. If you enter more than 11 TRUE\nanswers, we will take the first 11 only.</li>\n<li>To figure out the winner, we will compute the overlap score between the\nactual answers and your answer. The person with the highest overlap score\nwill win.</li>\n</ol>\n<h4>COMPUTING OVERLAP SCORE</h4>\n<p>The overlap score simply gives you one point for every answer where you answered\nTRUE and the correct answer was TRUE. For example, if the answer to question 3\nis True and you answered True, you get a point. In all other cases you dont get\na point for question 3. Note that since you can only put down 11 TRUEs, the\nmaximum overlap score you can get is 11.</p>\n<p>In case of ties, the earlier entries will win. (Also, if you submit more than\none entry, only the last entry will count.) Full details are explained in the\n<a href=\"/legal/rules/sparse-football-pool-ii-2015.html\">contest rules page</a>.\nOr feel free to post questions in the comment section below this blog post.</p>\n<h4>AND NOW, THE QUESTIONS</h4>\n<p>To enter, go to our\n<a href=\"https://numenta.wufoo.com/forms/entry-form-for-numenta-sparse-football-quiz-ii/\">online submission form</a>.\nYou will be asked to answer the following questions. They are repeated here for\nreference to help you plan out your answers ahead of time (responses will only\nbe accepted through the online submission form). Note that all entries must be\nreceived by 12 PM Pacific Standard Time on January 31, 2015.</p>\n<ul>\n<li>The New England Patriots will score first</li>\n<li>The Seattle Seahawks will score first</li>\n<li>There will be a lead change in the first half</li>\n<li>Russell Wilson will throw for more than 250 yards</li>\n<li>Tom Brady will throw for more than 300 yards</li>\n<li>Russell Wilson will attempt more passes than Tom Brady</li>\n<li>LeGarrette Blount will rush for more than 100 yards</li>\n<li>Marshawn Lynch will rush for more than 120 yards</li>\n<li>Jamie Collins will make the most tackles (solo plus assisted) in the game</li>\n<li>Rob Gronkowski will score a touchdown</li>\n<li>Rob Gronkowski will not score a touchdown</li>\n<li>Russell Wilson will throw at least two interceptions</li>\n<li>There will be a score in the final 2 minutes of the first half</li>\n<li>The team leading at the end of the first half will lose the game</li>\n<li>Halftime show performer Katy Perry will don more than one costume during her\nperformance</li>\n<li>Rihanna, Snoop Dogg, or Juicy J will join Katy Perry on stage during the\nhalftime show</li>\n<li>Kicker Steven Hauschka (Seahawks) will score more points than kicker Stephen\nGostkowski (Patriots)</li>\n<li>The New England Patriots will be penalized the most (in terms of yards)</li>\n<li>The Seattle Seahawks will be penalized the most (in terms of yards)</li>\n<li>There will be at least one lost fumble resulting in a change of possession in\nthe game</li>\n<li>Someone other than Russell Wilson or Tom Brady will throw a touchdown pass</li>\n<li>There will be kickoff or a punt that is returned for a touchdown (by either\nside)</li>\n<li>The game will have a Pick Six play where an interception is returned for a\ntouchdown</li>\n<li>There will be at least one successful coachs challenge that will overturn a\nruling on the field made by the referees</li>\n<li>There will be a score in the final 2 minutes of regulation</li>\n<li>The combined score at the end of the game will be greater than 50</li>\n<li>The combined score at the end of the game will be less than or equal to 50</li>\n<li>The winner will win by 10 or more points</li>\n<li>The Seattle Seahawks will claim their 2nd Superbowl Trophy!</li>\n<li>The New England Patriots will claim their 4th Superbowl Trophy!</li>\n</ul>\n<p><a href=\"https://numenta.wufoo.com/forms/entry-form-for-numenta-sparse-football-quiz-ii/\">Online Contest Submission Form</a>.</p>\n"}

