	module.exports = {"author":"Numenta","brief":"This years Super Bowl between the New England Patriots and the Seattle Seahawks was a cliffhanger. In fact, the twists and turns in the last few minutes had a significant effect on our result","date":"2015/02/04","featured":false,"image":"../images/image.png","org":"Subutai Ahmad & Ryan McCall","tags":"super bowl xlix neuroscience 2015 machine learning numenta sparse football pool results","title":"Super Bowl Neuroscience: Sparse Football Pool 2015 Results","body":"<h3>SUPER BOWL NEUROSCIENCE: SPARSE FOOTBALL POOL 2015 RESULTS</h3>\n<p>This years Super Bowl between the New England Patriots and the Seattle Seahawks\nwas a cliffhanger. In fact, the twists and turns in the last few minutes had a\nsignificant effect on our result, with some of the answers determined in the\nlast five minutes of the game. (To read the original blog post,\n<a href=\"/blog/introducing-sparse-football-pool-ii-super-bowl-xlix.html\">click here</a>).\nCongratulations to our winner Glen Speckert who, out of 95 contest\nentries, tied for the top score with 8 correct answers. The other top scorer was\nour own CEO, Donna Dubinsky, who also had a score of 8 (but is ineligible to win\na prize  sorry Donna!). Check out all of the\n<a href=\"/legal/results/sparse-football-pool-ii-2015.html\">results here</a>\nand see where you ranked.</p>\n<p>So, how does the Sparse Football Pool relate to the brain, the HTM Learning\nAlgorithms and intelligence? The remainder of this blog post will explain.</p>\n<p>HTM relies on Sparse Distributed Representations (SDRs), a form of information\nrepresentation where you have a long numerical string with mainly 0s and a few\n1s (the degree of sparsity is determined by how few 1s). In fact, each entry\nto the pool was an SDR  eleven 1s and nineteen 0s. SDRs are the fundamental\nway our brain represents information. At any point in time, most of the neurons\nin our brain are quiet and a small percentage of them are firing. We constructed\nthe Sparse Football Pool to highlight some of the special properties of SDRs. Of\ncourse, in the brain the numbers are far larger and the situation is more\ncomplex, but we can illustrate the basic concepts using the Pool.</p>\n<h4>NUMERICAL PROPERTIES OF SDRS</h4>\n<p>Even though there are only a small number of 1s, systems using SDRs can\nuniquely represent a massive number of patterns. Lets ask the following\nquestion: given that you could only select 11 True answers out of 30, how many\nunique entries are there? The answer is larger than you might guess: there are\n54,627,300 possible unique entries (we know that sounds like a lotits based on\na concept called\n<a href=\"http://en.wikipedia.org/wiki/Binomial_coefficients#Computing_the_value_of_binomial_coefficients\">binomial coefficients</a>).\nIn Numentas HTM systems, our patterns typically have 40 bits on out of 2,048.\nThe number of unique patterns is an unimaginably large 2.37 x 10^84!</p>\n<p>What is the chance someone else would have exactly the same answer as you?\nAssuming everything is random, thats just the flip side of the above question:\none in 54,627,300.</p>\n<p>What is the chance of someone getting a perfect score? Nine statements out of\nthe 30 actually came True. Each contestant could select up to 11 statements to\nbe True, so there was some room for error. Specifically, there are 9,405 answers\nthat could get the maximum score of 9, so again, if everything was random, the\nchance of getting a perfect score is about 9,405/54,627,300, or about 1 in\n5,808. (For more details on the math behind SDRs, see\n<a href=\"/learn/sparse-distributed-representations.html\">this talk</a>.)</p>\n<p>What is a good score? The chance of getting a score of 8 is 1 in 322, and the\nchance of getting a 7 is 1 in 37. Now, heres a puzzler: we had less than 100\nentries yet two people had a score of 8. How is this possible? The fact that a\nhighly improbable event occurred tells us that something non-random happened,\nand it relates to the semantic properties, or the meanings, of SDRs.</p>\n<h4>SEMANTIC PROPERTIES OF SDRS</h4>\n<p>The world is not random, and neither were the statements. Certain statements\ncould be grouped into similar semantic categories. If a contestants entry was\ntotally random, then it wouldnt matter. But, if a contestant had a point of\nview, this thinking would be evident in their entry/SDR.</p>\n<p>To be sure, the SDRs can represent very specific predictions. If you answered\nTrue to Statement 8 (Lynch will run for more than 120 yards), then you predicted\nMarshawn Lynch would do well in a very specific way.</p>\n<p>But SDRs also can represent more complex concepts. Suppose you answered True to\nstatements 3, 12, 13, 14, 20, 21, 23, 25, and 26 (Statement Group 1 below).\nThese statements are related in meaning; they all predict a wild and exciting\ngame. If your point of view was that the Super Bowl would be wild and exciting\nrather than low scoring and boring, your SDR would reflect this meaning. In\nanother example, if you answered True to statements 1, 5, 7, 9, 10, 19, 28, and\n30 (Statement Group 2 below), you predicted New England was going to dominate\nSeattle. This SDR reflects another point of view on the game. So, SDRs can\nrepresent something specific but also can simultaneously convey complex high-\nlevel information.</p>\n<p>Put another way, the distributed part of SDRs enable the encoding of subtle\ninformation. Looking again at Group 1 below, you didnt need to answer True to\nall the statements for us to know that you thought the game would be exciting \neven 3 or 4 Trues from this list would convey your point of view. You conveyed\nmore subtlety by choosing exactly which ones you answered as True. Even a\npartial answer tells us something about your thoughts; no particular answer is\ncritical. This structure is analogous to the brain: a sparse subsampling of\nactive neurons can represent lots of subtlety and complexity.</p>\n<p>Finally, SDRs can simultaneously represent multiple independent concepts. If you\nanswered True to, say, five from the first set, and five from the second set,\nyou believed both propositions  the game was going to be exciting, but in the\nend the Patriots were going to beat the Seahawks. The ability to simultaneously\nrepresent independent concepts is another property of SDRs. It is particularly\nimportant when you are making predictions. The HTM algorithms and the cortex use\nthis property to make simultaneous predictions about the future in a single\nfixed representation.</p>\n<p>How does this explanation answer the question as to why there were two winners,\nan extremely unlikely result? Both winners, Donna and Glen, guessed that New\nEngland would win in a high scoring, exciting game. They had a similar point of\nview, and they answered True or False to those statements that matched that\npoint of view. Their guesses werent perfect, but they werent random. Indeed,\nif you responded to the statements randomly, you probably didnt do too well!</p>\n<p>We have touched on a few properties of SDRs, some of them subtle. You can\nrepresent semantic properties and concepts. You can represent both very specific\nand very subtle concepts. You can represent multiple concepts simultaneously,\nwhich can be used in prediction. The Sparse Football Pool, Numentas HTM\ntechnology, and our brain rely on these same concepts.</p>\n<p>We hope the Pool helped you understand the power of SDRs and how our brains\nrepresent information. Most importantly, we hope you had fun with this unusual\npool! Next time your spouse complains you are watching too much football, let\nthem know you are actually involved in the greatest possible scientific quest:\nunderstanding human intelligence.</p>\n<p>Check out all of the\n<a href=\"/legal/results/sparse-football-pool-ii-2015.html\">results here</a>\nand see where you ranked.</p>\n<h3>STATEMENT GROUPS:</h3>\n<h4>GROUP 1 - OVERALL GAME EXCITEMENT</h4>\n<ul>\n<li>3: There will be a lead change in the first half</li>\n<li>12: Russell Wilson will throw at least two interceptions</li>\n<li>13: There will be points scored in the final 2 minutes of the first half</li>\n<li>14: The team leading at the end of the first half will lose the game</li>\n<li>20: There will be at least one lost fumble resulting in a change of possession in the game</li>\n<li>21: Someone other than Russell Wilson or Tom Brady will throw a touchdown pass</li>\n<li>23: The game will have a Pick Six play where an interception is returned for a touchdown</li>\n<li>25: There will be points scored in the final 2 minutes of regulation</li>\n<li>26: The combined score at the end of the game will be greater than 50</li>\n</ul>\n<h4>GROUP 2  NEW ENGLAND DOMINATION</h4>\n<ul>\n<li>1: The New England Patriots will score first</li>\n<li>5: Tom Brady will throw for more than 300 yards</li>\n<li>7: LeGarrette Blount will rush for more than 100 yards</li>\n<li>9: Jamie Collins will make the most tackles (solo plus assisted) in the game</li>\n<li>10: Rob Gronkowski will score a touchdown</li>\n<li>19: The Seattle Seahawks will be penalized the most (in terms of yards)</li>\n<li>28: The winning team will win by 10 or more points</li>\n<li>30: The New England Patriots will claim their 4th Superbowl Trophy!</li>\n</ul>\n"}

