	module.exports = {"author":"Alexander Lavin","brief":"Data is in ever-increasing supply as sensors inhabit more and more of our world. Examples abound from health data tracked by pacemakers and fitness wearables, to temperature sensors","date":"2015/06/02","featured":false,"image":"../images/graph2.png","org":"Software Engineer","tags":"nab numenta anomaly benchmark streaming data detection realtime","title":"NAB - A Benchmark for Streaming Anomaly Detection","body":"<h3>Numenta Anomaly Benchmark</h3>\n<h4>A Benchmark for Streaming Anomaly Detection</h4>\n<p>Data is in ever-increasing supply as sensors inhabit more and more of our world.\nExamples abound from health data tracked by pacemakers and fitness wearables, to\ntemperature sensors in aircraft engines and mobile phones. These sensors provide\nimportant information in real-time, streaming data. That is, time-series data,\nwhere there is a natural temporal ordering in the successive measurements made\nover a time interval.</p>\n<p>Take a look at Figure 1 below, an example of time-series data from a sensor. The\nplot shows scalar values over time for an unknown metric. Can you guess if the\nmetric is blood glucose level for a diabetes patient, stock volume for a Fortune\n500 company, or something else? Its difficult to tell, yet its apparent the\nplot shows data anomalies, or deviations from the normal pattern.</p>\n<p><img src=\"../images/graph1.png\" alt=\"NAB Screenshot 1\"></p>\n<blockquote>\n<p><strong>Figure 1</strong>  An example data file from the NAB corpus; data from monitoring\nthe temperature of an internal component of a large, expensive, industrial\nmachine. The three blue regions represent anomaly windows, and the purple\nregion is the detectors probationary period. For details on these and more\nNAB components, please explore the\n<a href=\"https://github.com/numenta/NAB/wiki\">NAB wiki</a> [1].</p>\n</blockquote>\n<p>Looking at the entire plot, these anomalies are easily recognized after-the-fact\nbut identifying anomalies long after they occur isnt acceptable. Yet many\nanomaly detection methods run in batch mode, where the data is collected and\nprocessed after the fact. Real-time data processing, on the other hand, calls\nfor continual input, process, and output of data. A real-world anomaly detector\nshould be required to process streaming data, learn continuously, and make\naccurate detections as soon as possible.</p>\n<p>At Numenta weve built a robust, real-time anomaly detector using\n<a href=\"http://numenta.com/assets/pdf/whitepapers/Numenta%20White%20Paper%20-%20Science%20of%20Anomaly%20Detection.pdf\">Hierarchical Temporal Memory (HTM)</a> [2].\nOur <a href=\"http://numenta.com/grok/\">Grok application</a> is great demo of the algorithm\nin action on server metrics data [3]. Other real-time anomaly detectors are\nout there, namely at\n<a href=\"http://labs.yahoo.com/news/announcing-a-benchmark-dataset-for-time-series-anomaly-detection/\">Yahoo</a> and\n<a href=\"https://blog.twitter.com/2015/introducing-practical-and-robust-anomaly-detection-in-a-time-series\">Twitter</a>\nwho both recently announced their activities in real-time anomaly\ndetection [4], [5]. But how can one truly discern whether or not these\nalgorithms are up to the task of streaming anomaly detection? Sure HTM does\ngreat on detecting anomalies in Amazon Web Services metrics with Grok, but what\nabout the other sensory domains?</p>\n<p>Enter the <strong>Numenta Anomaly Benchmark (NAB)</strong>, an open-source benchmark were\ndeveloping for the evaluation of real-time anomaly detection algorithms. The NAB\ndataset contains streaming data samples, aiming to capture the difficulties of\nreal-time anomaly detection, across varying real-world domains. A detector run\non this dataset is subject to evaluation by the NAB scoring method. To score\nwell on NAB, anomaly detection algorithms should: run in unsupervised mode,\nprocess real-time data, learn continuously, reliably detect anomalies, and\ndetect them as early as possible. Detailed descriptions of all NAB components\ncan be found in the NAB whitepaper posted in the\n<a href=\"https://github.com/numenta/NAB/wiki\">wiki</a> [1]. Figure 2 below shows the\nNumenta detector on the sample data file of Figure 1, where the algorithm\naccurately detected all three anomalies with no false positives.</p>\n<p><img src=\"../images/graph2.png\" alt=\"NAB Screenshot 2\"></p>\n<blockquote>\n<p><strong>Figure 2</strong>  NAB results for the Numenta detector on a data file\nrepresenting machine component temperature readings. The detections resulted\nin all three true positives, and no false positive nor false negatives.</p>\n</blockquote>\n<p>Were currently in a beta phase, working with a few select companies and\nresearchers to improve both the benchmark dataset and the scoring methods,\nbefore submitting the benchmark for publication. Our aim during this phase is to\ncollaborate with businesses that need real-time anomaly detection and\nresearchers working on novel algorithms. Part of the value of the benchmark is a\ndata set consisting of diverse sensory data streams with real labeled anomalies.\nAs such were particularly interested in real-world data files with actual\nanomalies to add to the dataset.</p>\n<h4>Call For Participation!</h4>\n<p>So far weve received some great feedback, but theres still a ways to go. You\ncan help. Please <a href=\"https://github.com/numenta/NAB/\">check out NAB</a> for yourself [6].\nDo you have data to contribute? Great, wed love to include it in the benchmark,\nas long as your data meets the following criteria:</p>\n<ul>\n<li>Real-world, time-series data</li>\n<li>Labeled or known anomalies</li>\n<li>Minimum 1000 records per data file (more would be ideal)</li>\n<li>Data records must be\n<ul>\n<li>from a continuously streaming source</li>\n<li>in chronological order</li>\n<li>at roughly equal time intervals</li>\n</ul>\n</li>\n<li>Scalar metric(s)</li>\n</ul>\n<p>If you have data you might be able to contribute, are interested in the\nbenchmark, or have questions, please contact us at\n<a href=\"mailto:nab@numenta.org\">nab@numenta.org</a>.</p>\n<p>No real-world anomaly detector is perfect, but which is best? Where do\nalgorithms make good and poor detections? NAB will be able to answer these\nquestions, providing the world of data analysis with a much-needed benchmark for\nthis very important class of algorithms.</p>\n<h4>References</h4>\n<ul>\n<li>[1] <a href=\"https://github.com/numenta/NAB/wiki\">https://github.com/numenta/NAB/wiki</a></li>\n<li>[2] <a href=\"http://numenta.com/assets/pdf/whitepapers/Numenta%20White%20Paper%20-%20Science%20of%20Anomaly%20Detection.pdf\">http://numenta.com/assets/pdf/whitepapers/Numenta White Paper - Science of Anomaly Detection.pdf</a></li>\n<li>[3] <a href=\"http://numenta.com/grok/\">http://numenta.com/grok/</a></li>\n<li>[4] <a href=\"http://labs.yahoo.com/news/announcing-a-benchmark-dataset-for-time-series-anomaly-detection/\">http://labs.yahoo.com/news/announcing-a-benchmark-dataset-for-time-series-anomaly-detection/</a></li>\n<li>[5] <a href=\"https://blog.twitter.com/2015/introducing-practical-and-robust-anomaly-detection-in-a-time-series\">https://blog.twitter.com/2015/introducing-practical-and-robust-anomaly-detection-in-a-time-series</a></li>\n<li>[6] <a href=\"https://github.com/numenta/NAB/\">https://github.com/numenta/NAB/</a></li>\n</ul>\n"}

