	module.exports = {"author":"Donna Dubinsky","brief":"In this post, Id like to tell you about some changes and updates to our open source and commercial licensing strategy. First, effective today, we will be using the AGPL open source license instead of","date":"2015/08/15","featured":false,"image":"../images/image.png","org":"CEO","tags":"numenta licensing update switch agpl agplv3 open source free software machine intelligence htm hierarchical temporal memory streaming temporal data patterns anomaly outlier detection","title":"Numenta Licensing Update and AGPLv3","body":"<h3>Numenta Licensing Update</h3>\n<p>In this post, Id like to tell you about some changes and updates to our open\nsource and commercial licensing strategy.</p>\n<p>First, effective today, we will be using the\n<a href=\"http://www.gnu.org/licenses/agpl-3.0.en.html\">AGPL open source license</a> instead\nof the GPL open source license for all of our open source software. When we made\nthe decision to use the GPLv3 license several years ago, the GPL seemed like a\ngood fit for our needs as we were trying to promote a community that shares\ntheir work, rather than going with a more permissive style license that allows\nindividuals to keep enhancements private. The AGPL is in keeping with that\nspirit and makes clear that use in a\n<a href=\"https://en.wikipedia.org/wiki/Software_as_a_service\">SaaS</a> implementation is\nalso considered a distribution and thus must fully comply with the GPL. The\nproposed changes were discussed on our mailing lists and the NuPIC community is\nsupportive of this change.  Note that the AGPLv3 is explicitly designed to be\nthe same as the GPLv3 with the additional of the SaaS clarification, and will\nnot impact open source developers in any other way.</p>\n<p>Second, we have heard from potential customers that some companies have\nprohibitions against their engineers using either the GPL or the AGPL.\nConsequently, we have created a very simple\n<a href=\"http://numenta.org/licenses/trial/\">Trial License</a>.  The Trial License confers\nno commercial rights, but allows research and experimentation with NuPIC\nsoftware without being required to use an open source license.</p>\n<p>Finally, as you may know, we have a dual license strategy for NuPIC in that we\noffer <a href=\"http://numenta.org/blog/2013/12/16/nupic-commercial-licenses.html\">commercial licenses</a>\nin addition to our open source license.  Recently, we have had an increase in\nrequests for commercial licenses to the point where we would like to create a\nstandard licensing program.  We are in the process of documenting this program\nto be released in the next few weeks.  We plan on having two types of license,\none geared towards start-up companies formed specifically to create HTM\napplications (with no up-front payments and a delayed royalty stream), and the\nother for established companies.  We hope these will cover the majority of cases\nbut of course, we can create custom licenses as needed.</p>\n<p>I believe that these license changes will have a positive impact both for the\n<a href=\"http://numenta.org\">NuPIC</a> open source community as well as for potential\ncommercial partners.  Other than the SaaS change, there is no other change in\nthe open source license such that researchers, students, and individual\nprogrammers can continue their work as before.   Commercial participants can use\nour Trial License, and will soon be able to evaluate our new standard licenses.</p>\n<p>Thank you for your continued support.</p>\n<p>Links:</p>\n<ul>\n<li><a href=\"http://www.gnu.org/licenses/agpl-3.0.en.html\">AGPLv3 License</a></li>\n<li><a href=\"http://numenta.org/licenses/trial/\">Numenta Trial License</a></li>\n<li><a href=\"http://numenta.org/blog/2013/12/16/nupic-commercial-licenses.html\">Numenta Commercial License</a></li>\n</ul>\n"}

