	module.exports = {"author":"Matthew Taylor","brief":"Numenta has held five hackathons over the past several years to engage our community of dedicated and passionate HTM enthusiasts. It's been a great time for lots of people involved. We've grown together and created some really interesting things!","date":"2015/09/29","featured":false,"image":"../images/image.png","org":"Open Source Manager","tags":"introducing numenta htm challenge hackathon nov 2015 onsite contest judging prizes jeff hawkins","title":"Introducing the Numenta HTM Challenge","body":"<p>Numenta has held\n<a href=\"http://numenta.org/blog/2013/06/25/hackathon-outcome.html\">five</a>\n<a href=\"http://numenta.org/blog/2013/11/06/2013-fall-hackathon-outcome.html\">hackathons</a>\nover the\n<a href=\"http://numenta.org/blog/2014/05/09/2014-spring-hackathon-outcome.html\">past</a>\n<a href=\"http://numenta.org/blog/2014/10/30/2014-fall-hackathon-outcome.html\">several</a>\n<a href=\"https://www.youtube.com/playlist?list=PL3yXMgtrZmDpDhDZvixTUubv9R9cpZK4T\">years</a>\nto engage our <a href=\"http://numenta.org/#community\">community</a> of dedicated and\npassionate HTM enthusiasts. Its been a great time for lots of people involved.\nWeve grown together and created some really interesting things!</p>\n<p>The one consistent complaint Ive gotten from hackathon attendees is that there\njust <em><strong>wasnt enough time</strong></em> to complete their projects. In response to this\nfeedback and our desire to incubate more complete HTM projects, we have\ncompletely changed the structure and format of our hackathons.</p>\n<h2>Introducting the Numenta HTM Challenge!</h2>\n<p>The <a href=\"http://htmchallenge.devpost.com/\">Numenta HTM Challenge</a> is an online\ncontest open for submissions <strong>today</strong> and running until November 14th.\nParticipants must come up with ideas for real-world applications of HTM\ntechnology and submit them for approval before starting work. This ensures the\nproblem being solved is applicable to HTM, and that the data being analyzed is\nadequate for HTM. Once a project has been approved, hackers have until\n<strong>November 6th</strong> to work on it and submit a demo video for judging.</p>\n<h3>Onsite Event Nov 14</h3>\n<p><strong>This Challenge can be completed <em>entirely</em> online</strong>, but we encourage you to\ntry to attend the\n<a href=\"http://www.meetup.com/numenta/events/224711586/\"><strong>Onsite Event</strong></a> that\nculminates the Challenge on November 14 in Redwood City, California. At this\nOnsite Event, all demonstration videos will be viewed by a judging panel and a\nlive audience. Judges will get a chance to comment and ask questions to\nsubmission authors (either live or over the phone). At the end of the event,\nwell announce the winners and cash prizes will be awarded!</p>\n<h4>Sessions</h4>\n<p>In addition to judging, there will also be at least two educational sessions by\nNumenta team members <strong>Subutai Ahmad</strong> and <strong>Jeff Hawkins</strong>. They will be\ntalking about the history and evolution of HTM algorithms and some details about\nnew algorithm development, respectively.</p>\n<h5>Temporal Pooling (Jeff Hawkins)</h5>\n<blockquote>\n<p>Temporal pooling is an important aspect of HTM theory. It refers to how\nrepresentations get more stable as sensory data moves from region to region\nascending the cortical hierarchy.  It plays an important role in inference,\nfeedback, and motor control. Our understanding of how temporal works has been\nrefined a couple of times since the original HTM white paper was published. In\nthis talk I will review the basic requirements of temporal pooling and introduce\na new model for temporal pooling, one that is more robust that previous\nversions. I will also discuss how we think this new temporal pooling model is\nimplemented in neurons in the neocortex.</p>\n</blockquote>\n<h5>Temporal Memory of HTM: A Retrospective (Subutai Ahmad)</h5>\n<blockquote>\n<p>Did you realize that the development of HTM algorithms at Numenta has been\ngoing on for over 10 years? Subutai (who has seen it all) will step you through\nthe sequence of HTM developments, from our very first demos, algorithms and\nproducts, to our current research on cortical algorithms. Come and see what we\nhave learned, and how our past informs our future.</p>\n</blockquote>\n<h4><a href=\"http://www.meetup.com/numenta/events/224711586/\">RSVP for the Onsite Event here</a></h4>\n<p><strong>You dont have to participate in the Challenge to attend the Onsite Event!</strong>\nMaybe you just want to come see the latest presentations from Numenta or watch\nthe Challenge demonstration judging. Thats great! We welcome you to mingle with\nus HTM enthusiasts.</p>\n<h3><a href=\"http://www.meetup.com/numenta/events/224711563/\">Community Meetup Nov 13</a></h3>\n<p>And as long as youll be in the area, there is a <strong>Community Event</strong> being\nplanned on the Friday before the Onsite Event. I hope youll attend just to\n<strong>meet the rest of the HTM community</strong>. This event is run <em>by</em> the NuPIC\ncommunity, <em>for</em> the NuPIC community. A schedule is in the works.</p>\n<p><strong><a href=\"http://www.meetup.com/numenta/events/224711563/\">RSVP for the Community Meetup here</a></strong></p>\n<h3>Help us build the future of Machine Intelligence!</h3>\n<p>We believe that HTM is the future of machine intelligence. This is a great\nchance for you to <strong>get involved</strong> and help us move this important technology\nforward. I hope youll consider being a part of this event in some way.</p>\n"}

