	module.exports = {"author":"Donna Dubinsky","brief":"Earlier this month, we ran a contest for our developer community to use our algorithms on real world problems.  The contest, called the HTM Challenge, was conceived by Matt Taylor, our community flag-bearer, as a way to enable the","date":"2015/12/01","featured":false,"image":"../images/image.png","org":"CEO","tags":"numenta htm challenge 2015 results hierarchical temporal memory hackathon nupic open source project intelligent applications","title":"Numenta HTM Challenge 2015 Results","body":"<p>Earlier this month, we ran a contest for our developer community to use our\nalgorithms on real world problems.  The contest, called the HTM Challenge, was\nconceived by Matt Taylor, our community flag-bearer, as a way to enable the\ncommunity to invest more time in trying to build an application than they can in\na weekend Hackathon.</p>\n<p>Overall, we were pleased with the result, with 14 entries submitted.  Each\nentrant was required to make a short video demonstrating the application.  You\ncan see them all here:</p>\n<p><a href=\"http://htmchallenge.devpost.com/submissions\">http://htmchallenge.devpost.com/submissions</a></p>\n<p>Its interesting to note that the #1 and #2 winners are both in the field of\ntransportation, one detecting car traffic anomalies and the other relative to\naviation anomalies, both using our geospatial encoder.</p>\n<p>To me, however, the most notable result of the contest was to realize the\nbreadth of the type of applications that can be addressed with HTM.  Although\nthese were just demonstration programs, not ready for commercialization, they\noffer support to the notion of a generalized machine intelligence approach.\nWhether the application was predicting traffic, tracking heart monitors,\nunderstanding natural language, or generating music, the exact same algorithm is\nat play, just like in your brain.</p>\n<p>We often talk about how our biologically derived technology is extremely\nflexible and applicable to many different problems. Its nice to see this\nreinforced with the wide variety of submissions. Thank you to everyone who\nparticipated in this challenge. We look forward to seeing what future\napplications will be built on HTM.</p>\n<p>See photos from the event held in Redwood City\n<a href=\"https://www.facebook.com/media/set/?set=a.10154222101422119.1073741834.321559142118&amp;type=3\">here</a>.</p>\n"}

