	module.exports = {"author":"Numenta","brief":"We are frequently asked how we distinguish our technology from others. This task is made difficult by the fact that there is not an agreed vocabulary; everybody uses the above terms (and other associated terms) differently","date":"2016/01/11","featured":false,"image":"../images/image.png","org":"Jeff Hawkins & Donna Dubinsky","tags":"numenta machine intelligence learning deep artificial ai htm brain neurons","title":"What is Machine Intelligence vs. Machine Learning vs. Deep Learning vs. Artificial Intelligence (AI)?","body":"<p>We are frequently asked how we distinguish our technology from others. This\ntask is made difficult by the fact that there is not an agreed vocabulary;\neverybody uses the above terms (and other associated terms) differently.  In\naddition, the commonly understood meaning of some of these terms has evolved\nover time.  What was meant by AI in 1960 is very different than what is meant\ntoday.</p>\n<p>In our view, there are three major approaches to building smart machines.  Lets\ncall these approaches <em>Classic AI</em>, <em>Simple Neural Networks</em>, and <em>Biological\nNeural Networks</em>.  The rest of this blog post will describe and differentiate\nthese approaches.  At the end, well include an example as to how each approach\nmight address the same problem.  This analysis is intended for a business rather\nthan technical audience, so we simplify somewhat and thus beg the indulgence of\ntechnical experts who might quibble with the details.</p>\n<h3><em>Classic AI</em> Approach</h3>\n<p>The earliest approaches to AI were computer programs designed to solve problems\nthat human brains performed easily, such as understanding text or recognizing\nobjects in an image. Results of this work were disappointing and progress was\nslow.  For many problems, researchers concluded that a computer had to have\naccess to large amounts of knowledge in order to be smart.  Thus they\nintroduced expert systems, computer programs combined with rules provided by\ndomain experts to solve problems, such as medical diagnoses, by asking a series\nof questions.  If the disease was not properly diagnosed, the expert adds\nadditional questions/rules to narrow the diagnosis.  A <em>Classic AI</em> system is\nhighly tuned for a specific problem.</p>\n<p>IBMs Watson could be viewed as a modern version of a <em>Classic AI</em> system.  It\nfocuses on creating a sophisticated knowledge base on a particular issue.\nAlthough Watson doesnt rely on encoded rules, it requires the close involvement\nof domain experts to provide data and evaluate its performance.  <em>Classic AI</em>\nhas solved some clearly defined problems but is limited by its inability to\nlearn on its own and by the need to create specific solutions to individual\nproblems.  In this regard, in spite of it being called artificial intelligence,\nit has very little in common with general human intelligence.</p>\n<h3><em>Simple Neural Network</em> Approach</h3>\n<p>Some early researchers explored the idea of neuron models for artificial\nintelligence. When the limits of <em>Classic AI</em> became clear, this notion picked\nup steam and with the addition of back propagation techniques, started proving\nuseful. The resulting technology, artificial neural networks (ANNs), was created\nover 50 years ago when very little was known about how real neurons worked.\nSince then, neuroscientists have learned a great deal about neural anatomy and\nphysiology, but the basic design of ANNs has changed very little. Therefore,\ndespite the name neural networks, the design of ANNs has little in common with\nreal neurons.  Instead, the emphasis of ANNs moved from biological realism to\nthe desire to learn from data without human supervision. Consequently, the big\nadvantage of <em>Simple Neural Networks</em> over <em>Classic AI</em> is that they learn from\ndata and dont require an expert to provide rules.  Today ANNs are part of a\nbroader category called machine learning which includes other mathematical and\nstatistical techniques. Machine learning techniques, including ANNs, look at\nlarge bodies of data, extract statistics, and classify the results.</p>\n<p>ANNs have recently evolved into Deep Learning networks, whose advances have been\nenabled by access to fast computers and vast amounts of data for training.  Deep\nLearning has successfully addressed many problems such as image classification,\nlanguage translation and identifying spam in email.</p>\n<p>Although Simple Neural Network systems can solve many problems that were not\nsolvable using <em>Classic AI</em>, they have limitations.  For example, they dont\nwork well when there is limited data for training, and they dont handle\nproblems where the patterns in the data are constantly changing. Essentially,\nthe Simple Neural Network approach is a sophisticated mathematical technique\nthat finds patterns in large, static data sets.</p>\n<p>There is a deeper and more important issue beyond the current limitations of\n<em>Classic AI</em> and of <em>Simple Neural Networks</em>. In our view, both of these\napproaches are not on a path to achieve true machine intelligence; they dont\nprovide a roadmap to get there, which brings us to the third approach.</p>\n<h3><em>Biological Neural Network</em> Approach</h3>\n<p>Everyone agrees that the human brain is an intelligent system; in fact it is the\nonly system everyone agrees is intelligent.  We believe that by studying how the\nbrain works we can learn what intelligence is and what properties of the brain\nare essential for any intelligent system. For example we know the brain\nrepresents information using sparse distributed representations (SDRs), which\nare essential for semantic generalization and creativity. We are confident that\nall truly intelligent machines will be based on SDRs. SDRs are not something\nthat can be added to existing machine learning techniques; they are more like a\nfoundation upon which everything else depends. Other essential attributes\ninclude that memory is primarily a sequences of patterns, that behavior is an\nessential part of all learning, and that learning must be continuous.  In\naddition, we now know that biological neurons are far more sophisticated than\nthe simple neurons used in the Simple Neural Network approach  and the\ndifferences matter. We believe you cant get to machine intelligence by\nincrementally building upon the simple neuron approach, but instead must throw\nit away and start over with a more realistic biological approach.</p>\n<p>Numentas technology, Hierarchical Temporal Memory (HTM), is the best example of\nthe <em>Biological Neural Network</em> approach.  Today, HTM systems are able to learn\nthe structure of streaming data, make predictions and detect anomalies. They\nlearn continuously from unlabeled data. By taking a robust biological approach,\nthe brain gives us a roadmap of where to direct our work in the future, such as\ncompleting our understanding of behavior, attention and short term memory.  This\nroadmap distinguishes HTM from other techniques and makes it the best candidate\nfor creating intelligent machines.</p>\n<h3>An Example</h3>\n<p>Lets take a problem and think about how it might be addressed in the three\ndifferent approaches.  Again, we oversimplify a bit in order to distinguish the\nmain differences of the three approaches.</p>\n<p>We have been asked to detect rogue behavior of an employee within an\norganization.  For example, companies with confidential information want to know\nif people with internal access are abusing that information.  A change in\nemployee behavior might be totally legitimate  the employee has changed roles,\nand now has new responsibilities  or it could be a problem.</p>\n<p>Rogue behavior is difficult to identify.  The <em>Classic AI</em> approach would\naddress this problem with a series of rules.  For example, lets consider an\nanalyst who works with confidential customer data.  The <em>Classic AI</em> system\nwould need a human to figure out likely problem scenarios then program the\nsystem to look for those scenarios.  This solution might flag any instance where\nthe analyst has accessed the customer file more than 10 times in the month.  As\nthe <em>Classic AI</em> system is deployed, and false positives and false negatives are\nexamined, the rules would be strengthened.  The new rule might say that an\nanalyst accessing customer data in the first few days of the month is not\nflagged, but it is for the remainder of the month.</p>\n<p>The <em>Simple Neural Network</em> approach would start with lots of historical data,\nnamely a large database of known problem scenarios.  The <em>Simple Neuron Network</em>\nsystem might figure out, for example, that abuse of this information only\nhappens in the last week of the month.  The system identifies such features and\nthen classifies an individual as unusual or not unusual.  Although it sounds\nsimilar to the <em>Classic AI</em> approach, in this case, the features are learned\nfrom the data, not from an expert.</p>\n<p>Both approaches have some problems.  With the <em>Classic AI</em> solution you need to\nknow what you are looking for.  But criminals constantly change strategies to\navoid detection and the rules dont adapt. The <em>Simple Neural Network</em> approach\nrequires a lot of labeled data to be able to find common features, but this kind\nof data generally doesnt exist for unusual behavior.  Both approaches are\nunsuitable for modeling individual behaviors and require the system to be\nretrained when new patterns arise.</p>\n<p>The <em>Biological Neural Network</em> approach would stream the data from each analyst\n(such as the details of the files routinely accessed, numbers of emails, numbers\nof postings, etc.) and would automatically build individual models of normal\nbehavior for each person.  The system would then predict what would be normal\nfor each analyst and would flag anything abnormal.  One could stream a lot of\ndifferent metrics without knowing which will be important  all the modeling is\nautomated.  The <em>Biological Neural Network</em> system does not need to know what it\nis looking for, can model each individual separately, and continuously learns as\ndata changes.</p>\n<p>In summary, below are the characteristics of the three different approaches:</p>\n<table>\n<thead>\n<tr>\n<th></th>\n<th><em>Classic AI</em></th>\n<th><em>Simple Neural Network</em></th>\n<th><em>Biological Neural Network</em></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Examples</td>\n<td>Watson</td>\n<td>Deep Learning</td>\n<td>Hierarchical Temporal Memory (HTM)</td>\n</tr>\n<tr>\n<td>Associated terms</td>\n<td>Expert systems</td>\n<td>Artificial Neural Nets (ANN) <br/> Machine learning</td>\n<td>Machine intelligence</td>\n</tr>\n<tr>\n<td>Data sources</td>\n<td>Rules from experts</td>\n<td>Large datasets</td>\n<td>Data streams</td>\n</tr>\n<tr>\n<td>Training</td>\n<td>Programmed by experts</td>\n<td>Derived from labeled databases</td>\n<td>Derived from unlabeled data streams</td>\n</tr>\n<tr>\n<td>Outputs</td>\n<td>Answers to questions</td>\n<td>Classification</td>\n<td>Prediction <br/> Anomaly detection <br/> Classification</td>\n</tr>\n<tr>\n<td>Batch vs. continuous learning</td>\n<td>Batch</td>\n<td>Batch</td>\n<td>Continuous</td>\n</tr>\n<tr>\n<td>Need to know what you are looking for</td>\n<td>Yes</td>\n<td>Requires labeled data</td>\n<td>No</td>\n</tr>\n<tr>\n<td>Many individual models</td>\n<td>Hard</td>\n<td>Hard</td>\n<td>Easy</td>\n</tr>\n<tr>\n<td>Biological basis</td>\n<td>None</td>\n<td>Simple</td>\n<td>Realistic</td>\n</tr>\n<tr>\n<td>Provides roadmap to machine intelligence</td>\n<td>No</td>\n<td>No</td>\n<td>Yes</td>\n</tr>\n</tbody>\n</table>\n<h3>Summary</h3>\n<p>We return to the question of terminology that we started this post with.  Our\nfeeling is that the term artificial intelligence has been used in so many ways\nthat it is now confusing.  People use AI to refer to all three approaches\ndescribed above, plus others, and therefore has become almost meaningless.  The\nterm machine learning is a more narrowly defined term for machines that learn\nfrom data, including simple neural models such as ANNs and Deep Learning.  We\nuse the term machine intelligence to refer to machines that learn but are\naligned with the <em>Biological Neural Network</em> approach.  Although there still is\nmuch work ahead of us, we believe the <em>Biological Neural Network</em> approach is\nthe fastest and most direct path to truly intelligent machines.</p>\n<p><em>This blog entry was modified on Thu Mar 24 2016 to clarify the timing of neural\nnetwork research.</em></p>\n"}

