	module.exports = {"author":"Christy Maver","brief":"This morning, as Hollywood anxiously awaited to hear the nominees for this years Academy Awards, another set of winners was recognized  not for motion pictures, but for artificial intelligence.","date":"2016/01/14","featured":false,"image":"../images/image.png","org":"Director of Marketing","tags":"numenta AI awards artificial machine intelligence learning deep htm brain neurons nupic","title":"And the award goes to","body":"<hr>\n<p>This morning, as Hollywood anxiously awaited to hear the nominees for this\nyears Academy Awards, another set of winners was recognized  not for motion\npictures, but for artificial intelligence. <a href=\"http://awards.ai/\">The Global Annual Achievement Awards\nfor Artificial Intelligence</a> were announced today by\n<a href=\"http://Awards.AI\">http://Awards.AI</a>.</p>\n<p><a href=\"http://Awards.AI\">Awards.AI</a> is part of the <a href=\"http://informed.ai/\">Informed.AI Network</a>, which\nprovides a range of information resources for Artificial Intelligence and\nMachine Learning. The awards are voted on by its community and designed to\ncelebrate the various achievements in developing new algorithms, products and\nservices across a number of different categories and industries, as well as the\nwork of startups and individuals whose focus on AI is advancing the field.</p>\n<p>Theres no question that interest, activity and progress in the field of\nartificial intelligence, (or <a href=\"http://numenta.com/blog/machine-intelligence-machine-learning-deep-learning-artificial-intelligence.html\">machine intelligence, as we would say here at\nNumenta</a>)\nis increasing every day.  The existence of these awards is a testament to the\ngrowing enthusiasm for this space. We were honored to see the community\nrecognize our work, along with our strategic partner,\n<a href=\"http://www.cortical.io/\">Cortical.io</a>, in several of the 10 categories of\nachievement in 2015:</p>\n<ul>\n<li>AI Company of the Year: <strong>Numenta</strong></li>\n<li>AI Person of the Year: <strong>Jeff Hawkins</strong></li>\n<li>AI Application of the Year: <strong>NuPIC</strong></li>\n<li>AI Startup of the Year: <strong><a href=\"http://Cortical.io\">Cortical.io</a></strong></li>\n</ul>\n<p>Our <a href=\"http://numenta.com/newsletters/year-in-review-numenta-2015.html\">most recent newsletter</a>\nshared what we thought to be highlights of our achievements in 2015.</p>\n<p><a href=\"http://Cortical.io\">Cortical.io</a> was recognized for developing a new approach for handling Big Text\nData with highly efficient semantic fingerprints and the <a href=\"http://Cortical.io\">Cortical.io</a> Retina,\nwhich is the first semantic engine able to process terabytes of unstructured\ntext in real time, for any language or business domain.</p>\n<p>You can see the full list of winners at <a href=\"http://awards.ai/\">http://awards.ai/</a> or follow them on\nTwitter <a href=\"https://twitter.com/Awards_AI\">@Awards_AI</a>.</p>\n<p>Most awards ceremonies include the seemingly never-ending Id like to thank\nspeeches.  Dont worry; no need to cue the orchestra here.  I will simply say on\nbehalf of Numenta, thanks to those who voted, and more importantly, thanks for\nfollowing us and our work here.  We appreciate the support, and it is great\nmotivation as we set out to accomplish even more in 2016.</p>\n"}

