	module.exports = {"author":"Subutai Ahmad","brief":"Eric Jonas and Konrad Kording just released a provocative paper, \"Could a neuroscientist understand a microprocessor?\". In their paper, they ask whether current neuroscience techniques could discover the operations of a simple microprocessor.","date":"2016/06/16","featured":false,"hideImage":false,"image":"../images/image.png","org":"VP of Research","tags":"neuroscientist understand microprocessor","title":"Can Neuroscientists Understand the Brain?","body":"<p>Eric Jonas and Konrad Kording just released a provocative paper, Could a\nneuroscientist understand a microprocessor?<sup><a href=\"#1\">[1]</a></sup> In their\npaper, they ask whether current neuroscience techniques could discover the\noperations of a simple microprocessor<sup><a href=\"#2\">[2]</a></sup>.</p>\n<p>Their reasoning is as follows. The field of neuroscience is trying to understand\nthe computational properties of the brain. If we think current neuroscience\ntechniques are sufficient to understand something as complex as the brain,\nsurely they will be able to handle a small microprocessor. If, on the other\nhand, current techniques are insufficient to understand even this simple CPU, it\nraises serious questions about the current approaches in the field. True, the\nbrain is not a silicon processor but there are similarities (they list several\nin the paper). So lets apply these techniques to this simpler computational\nsystem as a litmus test.</p>\n<p>Their methodology includes applying an array of traditional techniques such as\nlesioning, examining statistics of bit patterns, analyzing tuning properties of\ntransistors, dimensionality reduction, etc. They studied the microprocessor in\nvivo while playing a variety of video games (you can tell they had a lot of fun\nwith this project!) They were able to discover that transistors exhibited very\nlow pairwise correlations but were not actually independent (very similar to\nbehavior of neurons<sup><a href=\"#3\">[3]</a></sup>). They showed strong spatiotemporal\nstructure in the activity of various processor components. The resulting plots\nand charts look remarkably similar to those in neuroscience papers. Yet these\ntechniques did not uncover the true computational nature of the microprocessor\nnor its functional structure.</p>\n<p>Of course, in this process what they are really asking is Could a\nneuroscientist understand the brain?<sup><a href=\"#4\">[4]</a></sup> Their conclusion: an\nunequivocal NO.</p>\n<p>We all know that correlation does not imply causation. Current statistical\ntechniques report all sorts of correlations, but little regarding true\nunderlying structure.</p>\n<h3>What does it mean to understand the brain?</h3>\n<p>So what does it really mean to understand the brain? Unfortunately the paper\ndoes not answer this question. They do make vague comments that the field should\nunderstand how the output relates to the inputs, and that it should reward\n&quot;those who innovate methodologically.&quot; These statements are unsatisfactory at\nbest.</p>\n<p>I propose a much stronger answer. As a computer scientist, I believe the only\nway to be certain you understand something is to build it. Write the program for\nit. We dont need to create an exact replica, just a system that demonstrates\nthe important properties.  This methodology is harder but demands that you\nuncover underlying structure and function.</p>\n<p>Let me give an analogy using a different paradigm. Suppose cars didnt exist.\nHumans somehow get access to a luxury Mercedes sedan and the race is on to\nunderstand how it works.  Lets consider two alternative approaches.</p>\n<p>The first approach involves calculating a number of statistical measures and\nbuilding predictive models. These models might accurately predict the cars gas\nmileage under different conditions, such as going uphill vs downhill. They might\nbe able to plot precise acceleration profiles under different loads.  They would\nknow exactly how long it takes the air conditioning to cool the car in different\nclimates. Scientists would publish thousands of peer-reviewed papers with all\nsorts of equations and charts proving the accuracy of these models. But would\nthey really understand how the car works?</p>\n<p>The second approach involves using the car to deduce fundamental mechanisms such\nas a power source, transmission, and steering. It would focus on the function of\nthese subsystems, and less on details such as the strength of bolts or the\nefficiency of water pumps. To test our theories of function we would build a\nmuch simpler machine from scratch, perhaps something like a Ford\nModel T<sup><a href=\"#5\">[5]</a></sup>. This car would have a super simple engine and hand\ncranked starter. The controls might be awkward, the tires bad, and the seats\nuncomfortable. It would definitely have no air conditioning. It might not even\nbe as fast as a horse! But, you could actually drive this car. Because we\nunderstand how our simple car works, over time we can improve it and eventually\nbuild vehicles even better than the Mercedes prototype.</p>\n<h3>What is our approach?</h3>\n<p>At Numenta we are using this second approach to understanding the brain.  We are\nbuilding the Model T equivalent of the neocortex.</p>\n<p>We use neuroscience discoveries and details to deduce the fundamental components\nof intelligence. For example, we know that the neocortex learns a predictive\nmodel of the world. It learns continuously without supervision. We know that\nbehavior and sensory inference are not separate processes, but are intimately\nintegrated such that learning cannot be achieved without behavior. Our theories\nare constrained by and consistent with a great many neurosciences details, but\nour software simulations only capture the functional properties of the brain and\nnot all the details.  We are often asked, How do you decide what neuroscience\ndetails to include in your simulations and which to leave out?  The answer is\nwe include neuroscience details when they are essential for function. When we\nhit stumbling blocks we return to experimental neuroscience to provide clues and\nhard constraints on how to solve problems. Our simulations also provide insights\ninto the structure of cortex<sup><a href=\"#6\">[6]</a></sup><sup><a href=\"#7\">[7]</a></sup>.</p>\n<p>Compared to the brain, our software is at an early stage and primitive, like a\nModel T. But, you can actually take it for a spin, see how it performs, and then\nknow what areas need improvement.</p>\n<p>Can we understand the brain? We have made excellent progress with our approach.\nIf we stay focused on large-scale functional theories and building systems based\non those theories, the answer to this question is an unequivocal YES!</p>\n<h3>Footnotes and Citations</h3>\n<p><span id=\"1\" class=\"anchor\"></span>\n<strong>[1]</strong> Jonas, E., and Kording, K. (2016). Could a neuroscientist understand a\nmicroprocessor? Cold Spring Harbor Labs Journals bioRxiv doi:10.1101/055624.<br>\n<a href=\"http://biorxiv.org/content/early/2016/05/26/055624.abstract\">http://biorxiv.org/content/early/2016/05/26/055624.abstract</a></p>\n<p><span id=\"2\" class=\"anchor\"></span>\n<strong>[2]</strong> Specifically Motorola 6507, similar to what was used in the Apple I and\nAtari video game consoles 40 years ago.</p>\n<p><span id=\"3\" class=\"anchor\"></span>\n<strong>[3]</strong> Schneidman, E., Berry, M. J., Segev, R., and Bialek, W. (2006). Weak\npairwise correlations imply strongly correlated network states in a neural\npopulation. Nature 440, 100712. doi:10.1038/nature04701.</p>\n<p><span id=\"4\" class=\"anchor\"></span>\n<strong>[4]</strong> Note that the paper specifically targets computational neuroscience\ntechniques, not experimental neuroscience. The amount of experimental data\nin neuroscience has been exploding exponentially, but without good\ntheoretical guidance uncovering value is like finding a needle in a\nhaystack.</p>\n<p><span id=\"5\" class=\"anchor\"></span>\n<strong>[5]</strong> <a href=\"https://en.wikipedia.org/wiki/Ford_Model_T\">https://en.wikipedia.org/wiki/Ford_Model_T</a></p>\n<p><span id=\"6\" class=\"anchor\"></span>\n<strong>[6]</strong> Hawkins, J., and Ahmad, S. (2016). Why Neurons Have Thousands of\nSynapses, a Theory of Sequence Memory in Neocortex. Front. Neural\nCircuits 10. doi:10.3389/fncir.2016.00023.\n<a href=\"http://journal.frontiersin.org/article/10.3389/fncir.2016.00023/full\">http://journal.frontiersin.org/article/10.3389/fncir.2016.00023/full</a></p>\n<p><span id=\"7\" class=\"anchor\"></span>\n<strong>[7]</strong> Ahmad, S., and Hawkins, J. (2016). How do neurons operate on sparse\ndistributed representations? A mathematical theory of sparsity, neurons and\nactive dendrites. arXiv:1601.00720 [q<a href=\"http://bio.NC\">bio.NC</a>]. Available at:\n<a href=\"http://arxiv.org/abs/1601.00720\">http://arxiv.org/abs/1601.00720</a>.</p>\n"}

