	module.exports = {"author":"Jeff Hawkins","brief":"We are convening the leading venture and growth companies from around the world, highly curated by the GSV TEAM, to gather in Silicon Valley. We dont want incremental ideas","date":"2015/10/07","event":{"when":{"begin":"2015/10/07","end":"2015/10/09"},"where":{"desc":"GSVlabs","city":"Redwood City","state":"CA","country":"USA","web":"http://gsvlabs.com/gsv-pioneer/"},"who":"Jeff Hawkins","why":"Speaking"},"featured":false,"image":"../images/image.png","org":"Co-Founder","tags":"numenta jeff hawkins nupic htm machine intelligence gsv labs gsvlabs pioneer summit","title":"GSVlabs Pioneer Summit 2015","body":"<p>We are convening the leading venture and growth companies from around the world,\nhighly curated by the GSV TEAM, to gather in Silicon Valley. We dont want\nincremental ideas. Our main mission is to help accelerate entrepreneurs efforts\nto make a significant impact on industries and societies.</p>\n<p>In the spirit of Davos and TED, we want to explore the ideas that will transform\nand improve the world, yet focus on tangible companies that entrepreneurs are\nbuilding through blood, sweat and tears.</p>\n<p>Our goal is not to be the biggest summit, but to be the most impactful. We bring\ntogether the key people driving growth in the Global Silicon Valley. The\nPioneers at our Summit believe that we can build companies that are\ntransformative, global and inclusive.</p>\n"}

