	module.exports = {"author":"Alexander Lavin","brief":"Alexander Lavin, Numenta Research Engineer, speaks on Evaluating Realtime Anomaly Detection Algorithms  the Numenta Anomaly Benchmark, at IEEE ICMLA'15 Miami.","date":"2015/12/09","event":{"what":"Evaluating Realtime Anomaly Detection Algorithms  the Numenta Anomaly Benchmark","when":{"begin":"2015/12/09","end":"2015/12/11"},"where":{"desc":"TBD","city":"Miami","state":"FL","country":"USA","web":"http://www.icmla-conference.org/icmla15/"},"who":"Alexander Lavin","why":"Speaking"},"featured":false,"image":"../images/image.png","org":"Engineer","tags":"ieee machine learning conference numenta alexander lavin reserach numenta anomaly detection algorithm benchmark","title":"14th IEEE International Conference on Machine Learning and Applications (ICMLA)","body":"<h3>IEEE ICMLA15</h3>\n<h4>14th International Conference on Machine Learning and Applications</h4>\n<p>The 14th International Conference on Machine Learning and Applications (IEEE\nICMLA15) will be held in Miami, Florida, USA, December, 2015.</p>\n<p>The aim of the conference is to bring researchers working in the areas of\nmachine learning and applications together. The conference will cover both\ntheoretical and experimental research results. Submission of machine learning\npapers describing machine learning applications in fields like medicine,\nbiology, industry, manufacturing, security, education, virtual environments,\ngame playing and problem solving is strongly encouraged.</p>\n<p>Conference content will be submitted for inclusion into IEEE Xplore as well as\nother Abstracting and Indexing (A&amp;I) databases.</p>\n"}

