	module.exports = {"author":"Numenta","brief":null,"date":"2016/03/29","event":{"what":null,"when":{"begin":"2016/03/29","end":"2016/03/31"},"where":{"desc":"San Jose Convention Center, Booth #540","city":"San Jose","state":"CA","country":"USA","web":"http://conferences.oreilly.com/strata/hadoop-big-data-ca"},"who":null,"why":null},"featured":false,"image":"../images/image.png","org":"Event","tags":"strata hadoop world big data conference 2016 oreilly numenta machine intelligence","title":"Strata + Hadoop World 2016: OReilly Big Data Conference","body":"<blockquote>\n<p>Sponsored by Numenta. See us at Booth #540.</p>\n</blockquote>\n<h3>Event Details</h3>\n<p>Big data means big business. Learn to survive and thrive in a data-driven world.</p>\n<p>Make big data work. Weve assembled the worlds best data scientists, analysts,\nand executives from innovative companies of all sizes to share deep, hard-won\nknowledge. Compelling data case studies, proven best practices, effective new\nanalytic approaches, and core skills will give you insight around:</p>\n<ul>\n<li>Data-driven business</li>\n<li>Data innovations</li>\n<li>Data science &amp; advanced analytics</li>\n<li>Enterprise adoption</li>\n<li>Hadoop use cases</li>\n<li>Hadoop internals &amp; development</li>\n<li>IoT &amp; real-time</li>\n<li>Law, ethics, governance</li>\n<li>Security</li>\n<li>Spark &amp; beyond</li>\n<li>Visualization &amp; user experience</li>\n</ul>\n"}

