	module.exports = {"author":"Yuwei Cui","brief":null,"date":"2016/04/07","event":{"what":null,"when":{"begin":"2016/04/07 18:30","end":"2016/04/07 19:30"},"where":{"desc":"404 Bryant Street","city":"San Francisco","state":"CA","country":"USA","web":"https://www.eventbrite.com/e/ai-meetup-hierarchal-temporal-memory-presented-by-numenta-tickets-24327505223"},"who":"Yuwei Cui","why":"Speaking"},"featured":false,"image":"../images/image.png","org":"Research Engineer","tags":"numenta htm hierarchical temporal memory ai meetup san francisco","title":"AI Meetup - Hierarchical Temporal Memory","body":"<h3>Event Details</h3>\n<p>Hosted by San Francisco Artificial Intelligence Meetup. On April 7th, we are\nproudly having Yuwei Cui, Ph.D., and Research Engineer at Numenta who will\npresent us the heart of companys technology - Hierarchical Temporal Memory.</p>\n<p>HTM is a detailed computational theory of the neocortex. At the core of HTM are\ntime-based learning algorithms that store and recall spatial and temporal\npatterns. HTM is well suited to a wide variety of problems; particularly those\ninvolve streaming data and time-based patterns. The current HTM systems are able\nto learn the structure of streaming data, make predictions and detect anomalies.\nIt is distinguished from other techniques in its ability to learn continuously\nin a fully unsupervised manner.</p>\n<p>HTM has been tested and implemented in software, all of which is developed with\nbest practices and is suitable for deploying in commercial applications. The\ncore learning algorithms are fully documented and available in an open source\nproject called NuPIC.</p>\n"}

