	module.exports = {"author":"Numenta","brief":null,"date":"2016/04/26","event":{"what":"Machine Intelligence with Streaming Data. A new approach for anomaly detection and time-based learning.","when":{"begin":"2016/04/26 09:00","end":"2016/04/26 10:00"},"where":{"desc":"Online","city":null,"state":null,"country":null,"web":"http://www.prohuddle.com/webinars/ChristyAndScott/Machine_Intelligence_with_Streaming_Data_A_New_Approach.php"},"who":"Christy Maver & Scott Purdy","why":"Webinar"},"featured":false,"image":"../images/image.png","org":"Christy Maver & Scott Purdy","tags":"numenta webinar machine intelligence with streaming data","title":"Webinar: Machine Intelligence with Streaming Data","body":"<blockquote>\n<p><strong>Machine Intelligence with Streaming Data.</strong>\nA new approach for anomaly detection and time-based learning.</p>\n</blockquote>\n<h3>About the Webinar</h3>\n<p>Across every industry, we are seeing an exponential increase in the availability\nof streaming, time-series data. The real-time detection of anomalies has\nsignificant practical application. Finding anomalies in such data can be very\ndifficult, given the need to process data in real time, and learn while\nsimultaneously making predictions. With the increasing variety of streaming data\nsources, automated deploymentwithout manual parameter tuningis also becoming\nimportant.</p>\n<p>Numentas online sequence memory algorithm, called Hierarchical Temporal Memory\n(HTM), has been used to detect anomalies in IT monitoring, human behavior, the\nstock market, geospatial data, and more. This webinar will introduce this novel\ntechnique, demonstrate its broad applicability, and cover performance details\nfrom a published benchmark designed for real-time anomaly detection.</p>\n"}

