	module.exports = {"author":"Jeff Hawkins","brief":null,"date":"2016/05/12","event":{"what":"What is Intelligence, that a Machine Might Have Some?","when":{"begin":"2016/05/12 18:30","end":"2016/05/12 20:00"},"where":{"desc":"Indiegogo","city":"San Francisco","state":"CA","country":"USA","web":"http://www.meetup.com/NeuroTechSF/events/230385690/"},"who":"Jeff Hawkins","why":"Speaking"},"featured":false,"image":"../images/image.png","org":"Co-Founder","tags":"jeff hawkins numenta founder speaking machine intelligence artificial neocortex","title":"NeuroTechX meetup featuring Jeff Hawkins","body":"<blockquote>\n<p>What is Intelligence, that a Machine Might Have Some?</p>\n</blockquote>\n<h3>Event Details</h3>\n<p>On May 12, NeuroTechX and Indiegogo are proud to host Jeff Hawkins, co-founder\nof Numenta, who will give a talk titled, What is Intelligence, that a Machine\nMight Have Some?</p>\n<p>Theres no question that Artificial Intelligence (AI) is hotter than ever. Yet\nas interest continues to grow, so do the number of interpretations of AI itself.\nNumentas approach lays the groundwork for the new era of Machine Intelligence.\nLed by Hawkins, the companys mission is to reverse engineer the neocortex to\nbuild intelligent machines. This approach, which is not just biologically\ninspired, but biologically constrained, is based on the understanding that the\nbrain is the only example we have of an intelligent system.</p>\n<p>While theres more work to be done, Numenta has made great progress toward a\ncomputational theory of the neocortex called HTM. At the core of HTM are\ntime-based learning algorithms that store and recall spatial and temporal\npatterns. It is distinguished from other techniques in its ability to learn\ncontinuously in a fully unsupervised manner.</p>\n<p>In this talk, Jeff will raise important questions about the implications of this\nwork: what is the legacy that we should be aiming for? What is intelligence\nitself? What should we do to try to build intelligent machines? What might these\nmachines look like in the future and what will they do? Hell cover the\nbiological components of intelligence, the functional components of intelligence\nand the diversity of intelligence machines.</p>\n<p>Dont miss the chance to hear Jeff speak on this fascinating topic.</p>\n"}

