	module.exports = {"author":"Alexander Lavin","brief":null,"date":"2016/06/01","event":{"what":"Deriving Machine Intelligence from Neuroscience","when":{"begin":"2016/06/01 19:00","end":"2016/06/01 20:00"},"where":{"desc":"OC Deep Learning, HTM, ANN, NLP & AI Meetup","city":"Irvine","state":"CA","country":"USA","web":"http://www.meetup.com/OC-Deep-Learning-HTM-ANN-NLP-AI/events/230346144/"},"who":"Alexander Lavin","why":"Speaking"},"featured":false,"image":"../images/image.png","org":"Research Engineer","tags":"numenta machine intelligence neuroscience orange county oc meetup","title":"OC Meetup - Deriving Machine Intelligence from Neuroscience","body":"<p><strong>Hosted by: OC Deep Learning, HTM, ANN, NLP &amp; AI Meetup.</strong></p>\n<p>Alex will be presenting via webinar and his company Numenta whos a leader in\nthis new era of machine intelligence is kind enough to be sending us some\nmaterials and giveaways so we will be able to share in some first hand data\ncoming from this exciting field of Hierarchical Temporal Memory (HTM) which is\ndetailed computational theory based on the neocortex.</p>\n<p>This will be an interactive webinar for those that can not make it in person.\nSee event page to sign-up to attend in person, or via webinar.</p>\n"}

