	module.exports = {"author":"Subutai Ahmad","brief":null,"date":"2016/07/01","event":{"what":"Hierarchical Temporal Memory, a theoretical framework for both biological and machine intelligence","when":{"begin":"2016/07/01 13:15","end":"2016/07/01 13:40"},"where":{"desc":null,"city":"London","state":"United Kingdom","country":"England","web":"https://playfairaisummit2016.splashthat.com/"},"who":"Subutai Ahmad","why":"Speaking"},"featured":false,"image":"../images/image.png","org":"VP of Research","tags":"playfair ai summit 2016 subutai ahmad numenta htm hierarchical temporal memory theoretical biological machine intelligence","title":"Playfair AI Summit 2016","body":"<h3>About the Event</h3>\n<p>Artificial intelligence is transforming our world. <strong>Fast.</strong></p>\n<p>In its second edition, the Playfair AI Summit 2016 will explore the frontiers of\nAI research and how these technologies are leveraged by companies to extend the\nfunctionality of products and services, as well as enable entirely new ones\naltogether. Its overwhelmingly clear that AI is transforming our personal and\nprofessional lives, as well as the operations of businesses worldwide. AI also\nhas profound implications for the future fabric and functioning of society.</p>\n<p>Keeping with last years tradition, the Playfair AI Summit 2016 will showcase\nthe brightest academic and entrepreneurial leaders in engineering, research,\nproduct development from the most exciting technology companies and\nUniversities. Conversations will be led by the industrys most respected\njournalists and thinkers.</p>\n"}

