	module.exports = {"author":"Numenta","brief":null,"date":"2016/07/24","event":{"what":"Numenta Anomaly Benchmark Competition for Real-time Anomaly Detection @ IEEE WCCI 2016","when":{"begin":"2016/07/24","end":"2016/07/29"},"where":{"desc":"IEEE WCCI 2016","city":"Vancouver","state":"British Columbia","country":"Canada","web":"http://numenta.org/nab/"},"who":null,"why":null},"featured":false,"image":"../images/image.png","org":"Event","tags":"numenta anomaly benchmark competition nab ieee wcci world congress computational intelligence 2016","title":"IEEE WCCI 2016 - Numenta Anomaly Benchmark Competition","body":"<p><a href=\"http://numenta.org/nab/\">Numenta Anomaly Benchmark Competition</a> for Real-Time\nAnomaly Detection at <a href=\"http://www.wcci2016.org/programs.php?id=home\">IEEE WCCI 2016</a>\n(World Congress on Computational Intelligence).</p>\n<h3>About Competition</h3>\n<p>Do you have an algorithm that detects anomalies in streaming data? Or a dataset\nof real-world, time-series data with labeled anomalies? If so, youre encouraged\nto enter the Numenta Anomaly Benchmark (NAB) Competition.</p>\n<h3>About Conference</h3>\n<p>IEEE WCCI has traditionally been the largest technical event in the field of\ncomputational intelligence, hosting three separate prestigious conferences\n(IJCNN, FUZZ-IEEE, IEEE CEC) under one roof. Over the years the event has\nprovided a platform for highly acclaimed intellectuals from all over the world\nto discuss and present their research findings on computational intelligence.\nThe organizing committee will put in place a rich and varied technical program\nwhich is designed to engage participants in cross-fertilization of ideas among\nthe three big areas in computational intelligence. The event will also offer a\nseries of social functions, such as welcome reception, conference banquet etc.,\nwhich will serve as a good channel to establish new connections and foster\neverlasting friendship among fellow counterparts.</p>\n"}

