	module.exports = {"author":"Numenta","brief":null,"date":"2016/11/11","event":{"what":null,"when":{"begin":"2016/11/11","end":"2016/11/11"},"where":{"desc":"Hotel Nikko","city":"San Francisco","state":"CA","country":"USA","web":"http://mlconf.com/events/san-francisco-ca/"},"who":null,"why":null},"featured":false,"image":"../images/image.png","org":"Research Team","tags":"numenta machine learning conference san francisco sf 2016","title":"MLconf 2016 Machine Learning Conference San Francisco","body":"<h3>About the MLconf</h3>\n<p>The Machine Learning Conference (MLconf) began in 2012, as a partnership with\nCarnegie Mellon Universitys GraphLab team, to gather the thought leaders in\nMachine Learning, specifically Graph Databases.</p>\n<p>In 2013, MLconf became a separate event, devoted to the Machine Learning and\nData Science community in San Francisco, agnostic of any tool, platform or\ncompany. MLconf events host speakers from various industries, research and\nuniversities to discuss recent research and application of Machine Learning\nmethodologies and practices. In 2014, MLconf entered NYC and Atlanta, as well as\nSan Francisco. In 2015, MLconf will host conferences in NYC, Atlanta, Seattle\nand San Francisco, with plans to enter additional US cities in 2016, and the UK.</p>\n<p>MLconf gathers communities to discuss the recent research and application of\nAlgorithms, Tools, and Platforms to solve the hard problems that exist within\norganizing and analyzing massive and noisy data sets.</p>\n"}

