	module.exports = {"title":"Privacy Policy","body":"<p><strong>Updated:</strong> 22 July 2016</p>\n<p>These terms of service apply to the use of Numentas streaming analytics product\nas distributed through cloud service providers (the Grok Product) and for the\nuse of Numentas web site. Together, the Grok Product and the Numenta web site\nare called the Numenta Offering.</p>\n<h3>1. ACCEPTANCE OF TERMS</h3>\n<p>If you do not agree to these Terms, you should not use the Numenta Offering. We\nreserve the right to change, modify, add or remove portions of these Terms\nperiodically. Such modifications shall be effective immediately upon posting of\nthe modified Terms to the Numenta website. Your continued use of the Numenta\nOffering will mean that you accept these terms.</p>\n<h3>2. NO UNLAWFUL OR PROHIBITED USE</h3>\n<p>You warrant to Numenta that you will not use the Numenta Offering, or any of the\ncontent therein, for any purpose that is unlawful or that is prohibited by these\nTerms.</p>\n<h3>3. LICENSE GRANT</h3>\n<p>Your rights to access, download, and use the Grok Product will be subject to the\nterms and conditions of the software license agreement provided on the cloud\nservice providers site through which it is distributed.</p>\n<h3>4. YOUR CONTENT</h3>\n<p>Numenta will not pre-screen or review your content, but Numenta shall have the\nright (but not the obligation) in its sole discretion to refuse or delete any\ncontent that it reasonably considers to violate the Terms or to be otherwise\nillegal.</p>\n<p>You grant Numenta the right to review your content for the purposes of debugging\nthe Numenta Offering and for providing you with technical support. Numenta will\nnot share your content with others without your explicit, written permission,\nexcept in the case where being required to do so by the appropriate court or\ngovernment agency.</p>\n<h3>5. TERMINATION</h3>\n<p>We may terminate your use of the Numenta Offering if we have reasonable belief\nthat your use: 1) violates these Terms; or 2) abuses site resources or attempts\nto gain unauthorized entry to the site or site resources; or 3) we are required\nto do so by law, regulation, court or governing agency order.</p>\n<p>Our termination of any users access to the Numenta Offering may be effected\nwithout notice and, on such termination, we may immediately deactivate or delete\nusers account and/or bar any further access to such files. Numenta shall not be\nliable to any Numenta user or other third party for any such termination.</p>\n<p>You may terminate your use of the Numenta Offering by stopping its use without\nnotice to us.</p>\n<h3>6. PAYMENT</h3>\n<p>The Numenta Product is delivered through a cloud service providers marketplace.\nYou will abide by the payment terms as detailed in that marketplace. If you do\nnot wish to continue using and paying for the Numenta Product, you may stop\nusing it at any time, and further charges will not accrue. We do not offer\nrefunds for any amounts paid.</p>\n<h3>7. LINKS</h3>\n<p>To the extent the Numenta website includes links to third parties, Numenta is\nnot responsible or liable for the content of such sites. The Numenta website\nprivacy statement is applicable only when you are on the Numenta websites.</p>\n<h3>8. SUPPORT</h3>\n<p>Technical support for the Grok Product is provided by email. We will make a\nreasonable effort to respond to your email within 48 hours. Support inquiries\nare to be sent to <a href=\"mailto:support@numenta.com\">support@numenta.com</a>.</p>\n<h3>9. TRADEMARK INFORMATION</h3>\n<p>Numenta, Grok, NuPIC, and the Numenta, Grok and NuPIC trademarks, logos and\nservice marks are the intellectual property of Numenta, Inc.</p>\n<p>All trademarks, trade names, service marks and logos referenced herein are the\nproperty of their respective owners.</p>\n<h3>10. COPYRIGHTS</h3>\n<p>If you believe that your work has been copied and is accessible in the Numenta\nOffering in a way that constitutes copyright infringement, you may notify us by\nproviding our copyright agent with the following information in writing:</p>\n<ul>\n<li>\n<p>the electronic or physical signature of the owner of the copyright or the\nperson authorized to act on the owners behalf;</p>\n</li>\n<li>\n<p>identification of the copyrighted work that you claim has been infringed;</p>\n</li>\n<li>\n<p>identification of the material that is claimed to be infringing and\ninformation reasonably sufficient to permit Grok to locate the material;</p>\n</li>\n<li>\n<p>your name, address, telephone number, and email address;</p>\n</li>\n<li>\n<p>a statement by you that you have a good faith belief that the disputed use is\nnot authorized by the copyright owner, its agent, or the law;</p>\n</li>\n<li>\n<p>a statement, made under penalty of perjury, that the above information in\nyour Notice is accurate and that you are the copyright owner or are authorized\nto act on the copyright owners behalf.</p>\n</li>\n</ul>\n<p>If Numenta receives such a claim, Numenta will investigate and report back to\nthe complainant. Numenta reserves the right to delete such reported content or\nto terminate a users account.</p>\n<p>Our designated agent to receive notification of claimed infringement under the\nDigital Millennium Copyright Act OF 1998 (DMCA) is:\n<a href=\"mailto:dmca@numenta.com\">dmca@numenta.com</a></p>\n<h3>11. VIOLATIONS OF TERMS</h3>\n<p>Please report any violations of the Terms to\n<a href=\"mailto:info@numenta.com\">info@numenta.com</a>.</p>\n<h3>12. PRIVACY</h3>\n<p>Our Privacy Policy is located at <a href=\"http://numenta.com/legal/privacy/\">http://numenta.com/legal/privacy/</a>.</p>\n"}

