	module.exports = {"author":"Donna Dubinsky","brief":"In order to encourage our developers and to facilitate the creation of applications, we have decided to release substantially more of our technology into open source. To that end, we just added to the code base two complete products","date":"2015/06/09","featured":false,"image":"../../../../images/numenta.png","org":"CEO","tags":"numenta open source htm products apps applications nupic june 2015 newsletter donna dubinsky","title":"June 2015 Newsletter: Numenta Releasing Two Complete HTM Products into Open Source","body":"<h3>Numenta Newsletter</h3>\n<p><strong>June 09, 2015</strong></p>\n<p>Dear Numenta newsletter subscriber:</p>\n<p>Im writing to update you on exciting news for our open source project, NuPIC.</p>\n<p>In order to encourage our developers and to facilitate the creation of\napplications, we have decided to release substantially more of our technology\ninto open source. To that end, we just added to the code base two complete\nproducts: Grok for IT Analytics and HTM for Stocks (an example application\nthat will be made available to end users shortly). The released code for these\nproducts includes the HTM Engine as well as two different Android applications.\nThe HTM Engine runs multiple anomaly models in an easy, scalable way, allowing a\nsingle server to manage and run thousands of HTM models. The Android\napplications act as a client to the HTM engine, pulling in the data to display\nit in a human-understandable format. We are developing tutorials that will help\ndevelopers come up to speed on this new technology.</p>\n<p>This source code has been open-sourced under the AGPLv3.0 license<sup><a href=\"#agpl\">*</a></sup>. You can find\nall the code on <a href=\"https://github.com/numenta/numenta-apps\">GitHub</a>.</p>\n<p>We hope that developers will find this source code beneficial as example\napplications of NuPIC. If you are interested in creating a commercial\napplication using this code, you may do so in accordance with the terms of the\nAGPLv3<sup><a href=\"#agpl\">*</a></sup>, or may <a href=\"mailto:sales@numenta.com\">write us</a> to request a separate,\ncommercial license if you prefer different terms. Commercial licenses are\nhandled on a case-by-case basis. For more information on our open source\nlicensing, see: <a href=\"http://numenta.org/licenses/\">License</a>,\n<a href=\"http://numenta.org/blog/2013/07/01/patent-position.html\">Patent Position</a>,\n<a href=\"http://numenta.org/blog/2013/12/16/nupic-commercial-licenses.html\">Commercial Licenses</a>.</p>\n<p>We invite you to join our growing open source community.</p>\n<p><small id=\"agpl\" class=\"disclaimer\"><sup>*</sup> This content has been updated to reflect our <a href=\"http://numenta.org/blog/2015/08/17/licensing-update.html\">new AGPL license</a>.</small></p>\n"}

