	module.exports = {"author":"Donna Dubinsky","brief":"Over the last two years, we have created a series of example applications that illustrate the capabilities of HTM. Grok for IT Analytics, available for download on the Amazon Web Services Marketplace","date":"2015/07/02","featured":false,"image":"../images/image.png","org":"CEO","tags":"htm for stocks monitor stock price volume twitter anomaly outlier detection numenta open source htm app application nupic","title":"July 2015 Newsletter: Announcing HTM for Stocks - Open Source Example HTM App","body":"<h3>Numenta Newsletter</h3>\n<p><strong>July 02, 2015</strong></p>\n<p>Dear Numenta newsletter subscriber:</p>\n<p>Over the last two years, we have created a series of example applications that\nillustrate the capabilities of HTM.  Grok for IT Analytics, available for\ndownload on the Amazon Web Services Marketplace, uses HTM to detect anomalies in\nAWS server metrics. We have published source code for several other example\napplications that use HTM to detect anomalies in human behavior, and in GPS\ndata. But up until now it hasnt been easy for an individual to get a sense of\nhow HTM-based anomaly detection works; you either need to bring up an AWS server\ninstance, or put in a reasonable amount of software development effort.</p>\n<p>So we have created a new example application, called HTM for Stocks, which\nmakes it much easier for you to experience how HTM detects anomalies. HTM for\nStocks is available for free here:\n<a href=\"http://numenta.com/htm-for-stocks/#get\">Download HTM for Stocks</a>. At this\npoint, the application is available only for an Android mobile device.</p>\n<p>HTM for Stocks applies HTM modeling and anomaly detection to 200 large\ncapitalization public companies.  The application automatically models three\ndata streams for each stock:  stock volume, stock price, and Twitter volume.  It\nfigures out normal for each of these data streams for each company, and then\nlets you know if something abnormal has occurred.</p>\n<p>Here is what we hope you will notice when using HTM for Stocks:</p>\n<ul>\n<li>\n<p>HTM enables automatic modeling of many models here, we are creating 600\nseparate models (3 for each of 200 companies).  No human intervention is\nrequired to adjust parameters or tune models.</p>\n</li>\n<li>\n<p>HTM models learn continuously, with each new data point.  If a company changes\nits fundamentals, taking its stock volume to a new level, at first it will\nshow an anomaly, but after a short period, it will learn the new normal.</p>\n</li>\n<li>\n<p>The models are ranked by the most anomalous to the least anomalous.  If you\nscroll down, you will note that many of the stocks show no anomalies.  This\nranking of anomalies allows you to focus on the companies that are the most\ndifferent from the norm.</p>\n</li>\n</ul>\n<p><img src=\"/assets/img/pages/newsletters/2015-07-02/homescreen.png\" alt=\"HTM for Stocks Home Screen\"></p>\n<p>Some of the anomalies detected by HTM for Stocks may appear obvious but others\nare subtle and not easily detected by a human.  For example, if you watch stock\nvolumes, you will see that there often is a spike in the beginning and at the\nend of the trading day.  It will notice if those spikes continue longer than\nnormal for that particular stock.  Such examples demonstrate the power of\nfinding temporal patterns</p>\n<p>When you see an anomaly, its very informative to look at the Twitter stream for\nthe corresponding time frame.  There, you often will be able to quickly\ndetermine the reason for the anomaly, such as an earnings announcement, a\ntakeover bid, a lawsuit, or a rapidly growing interest in something the company\ndid.</p>\n<p>In keeping with our focus as a technology provider, we do not intend to build\nHTM for Stocks into a full commercial application, and so we have provided the\nsource code for HTM for Stocks alongside our NuPIC open source project at\n<a href=\"https://github.com/numenta/numenta-apps\">https://github.com/numenta/numenta-apps</a>, available under a AGPL v3 license<sup><a href=\"#agpl\">*</a></sup>.\nDevelopers may find that HTM for Stocks code can be used to create derivative\nproducts that track other data streams.  We also welcome partners who are\ninterested in a commercial license to the HTM for Stocks code; in this case\nplease write to <a href=\"mailto:sales@numenta.com\">sales@numenta.com</a>.</p>\n<p>We hope that you will enjoy using HTM for Stocks.  We welcome your feedback at\n<a href=\"mailto:feedback@numenta.com\">feedback@numenta.com</a>.</p>\n<p><small id=\"agpl\" class=\"disclaimer\"><sup>*</sup> This content has been updated to reflect our <a href=\"http://numenta.org/blog/2015/08/17/licensing-update.html\">new AGPL license</a>.</small></p>\n"}

