	module.exports = {"author":"Donna Dubinsky","brief":"I am excited to tell you about a new partnership between Numenta and Avik Partners, an IT services and advanced analytics company. Before I tell you more about Avik, I want to remind you of our strategy for","date":"2015/09/01","featured":false,"image":"../images/image.png","org":"CEO","tags":"numenta partnership avik partners grok stream for it analytics","title":"September 2015 Newsletter: Partnership between Numenta and Avik Partners on Grok for IT Analytics","body":"<h3>Numenta Newsletter</h3>\n<p><strong>September 01, 2015</strong></p>\n<p>Dear Numenta newsletter subscriber:</p>\n<p>I am excited to tell you about a new partnership between Numenta and Avik\nPartners, an IT services and advanced analytics company.</p>\n<p>Before I tell you more about Avik, I want to remind you of our strategy for\ndeploying HTM technology.  Over the past few years we have made excellent\nprogress in turning HTM cortical theory into a valuable technology, first for\nstreaming analytics, but ultimately as a core component of machine intelligence.\nIn order to demonstrate how HTM technology can be used, we created several\nexample applications.  Our plan is to partner with applications developers to\nbring commercial solutions to the market while we focus on developing the\nscience and technology.  Earlier this year we announced our first such\nrelationship with <a href=\"http://Cortical.io\">Cortical.io</a>, a company using HTM technology for natural\nlanguage applications.</p>\n<p>Avik Partners is our second commercial partnership.  Casey Kindiger, CEO of\nAvik, is a proven entrepreneur with deep experience in IT and developer\noperations.  Casey became intrigued with our Grok for IT Analytics example\napplication, recognizing the substantial commercial potential for our advanced\nanomaly detection capability in the IT environment, and approached us about a\nlicense.</p>\n<p>Our relationship with Avik is structured as a strategic partnership.  Avik will\nassume our Grok for IT product (including the name Grok), enhance the\napplication with the many features that have been requested, and market it to\nenterprise IT organizations.  Avik will be doing business on the\n<a href=\"http://grokstream.com\">http://grokstream.com</a> website, where you can sign up to receive information\nwhen the product is available.  We expect to complete the transition of the Grok\nfor IT Analytics product to Avik within 30 days.  As part of the license,\nNumenta has taken a minority ownership position in Avik.</p>\n<p>We believe that Avik is an ideal partner to apply HTM technology to solve major\nproblems in complex IT organizations.  Given the breadth of potential HTM\napplications, we are excited about our discussions with several other potential\nlicensees who want to apply HTM technology to a wide variety of application\ndomains.  Over time, we hope to establish a constellation of partners building\nintelligent applications using HTM technology.</p>\n<p>In order to facilitate consideration of a license, we have created several\nstandard license options.  We realize that these standard licenses wont fit\nevery situation, so we also offer custom licenses.  We have just published a new\n<a href=\"/assets/pdf/apps/licensing-guide.pdf\">license guide</a> with details.  If you are\ninterested in becoming a licensee, please review this document, and feel free to\nwrite to us at <a href=\"mailto:sales@numenta.com\">sales@numenta.com</a>.</p>\n<p>Please join me in congratulating Casey and Avik Partners.  We look forward to\nworking together to bring machine intelligence to improve management of IT\ninfrastructure.</p>\n"}

