	module.exports = {"author":"Donna Dubinsky","brief":"To start with, Im pleased to announce that we have a paper accepted on the Numenta Anomaly Benchmark (NAB).  Ive written to you about the development of","date":"2015/10/01","featured":false,"image":"../images/image.png","org":"CEO","tags":"numenta anomaly benchmark nab numenta htm challenge nupic onsite november 2015","title":"Numenta Anomaly Benchmark (NAB), and Numenta HTM Challenge","body":"<h3>Numenta Newsletter October 2015</h3>\n<h4>Numenta Anomaly Benchmark (NAB), and Numenta HTM Challenge</h4>\n<p>To Numenta newsletter subscribers:</p>\n<p>Im writing with a few exciting updates from Numenta.</p>\n<p>To start with, Im pleased to announce that we have a paper accepted on the\nNumenta Anomaly Benchmark (NAB).  Ive written to you about the development of\nNAB in the past.  NAB is essentially two things.  First, it consists of over 50\nstreaming data files with anomalies that are marked for ground truth.  These\nfiles are a combination of real-world data sets along with some simulated data\nsets.  Second, there is a scoring mechanism that is designed for streaming data.\nNumentas HTM algorithms do a great job at finding temporal structure, learning\ncontinuously, and detecting anomalies early.  These are valuable properties for\nreal-time streaming applications but benchmarks designed for batch data dont\nincorporate them. For example, traditional benchmarks do not give credit for\nfinding an anomaly sooner rather than later.  Our development of NAB is an\neffort to create such a benchmark.</p>\n<p>We will be releasing NAB into open source such that the community can add new\ndata sets, propose different scoring mechanisms, and test/compare other\nalgorithms with HTM.  We hope that the developers in the community will get\nbehind NAB and enable a robust comparison of our anomaly detection with other\ntechniques.</p>\n<p>For more information on NAB, <a href=\"https://github.com/numenta/NAB\">go here</a>. We will\nbe presenting NAB at two conferences\n(<a href=\"http://mlconf.com/events/san-francisco-ca/\">MLconf SF</a> on November 13 in\nSan Francisco, and the\n<a href=\"http://www.icmla-conference.org/icmla15/\">IEEE Conference on Machine Learning and Applications</a>\non December 9-11 in Miami), so if you are in the vicinity, we hope you will be\nable to attend. Of course, once the paper is published, we will send you\nthe link.</p>\n<p>My second topic is an update from the NuPIC community.  We recently announced\nthe HTM Challenge.  The idea of the HTM Challenge is to provide a structure to\nencourage members of our open source community to create HTM sample\napplications. And, to add an extra incentive, were offering cash prizes of\n$3000 for first place, $2000 for second place and $1000 for third place, along\nwith some fun door prizes.</p>\n<p>The <a href=\"http://htmchallenge.devpost.com/\">Numenta HTM Challenge</a> is an online\ncontest open for submissions now and running until November 14th. Participants\npropose ideas for real-world applications of HTM technology and submit them for\napproval before starting work. We will check that the problem being solved is\napplicable to HTM, and that the data being analyzed is a good fit for HTM.\nOnce a project has been approved, hackers have until November 6th to work on it\nand submit a demo video for judging.</p>\n<p>This Challenge can be completed entirely online, but we encourage you to try to\nattend the <a href=\"http://www.meetup.com/numenta/events/224711586/\">onsite event</a> that\nculminates the Challenge on Saturday, November 14 in Redwood City, California.\nAt this event, all demonstration videos will be viewed by a judging panel and a\nlive audience. Judges will get a chance to comment and ask questions to\nsubmission authors (either live or over the phone). At the end of the event,\nwell announce the winners and cash prizes will be awarded.</p>\n<p>In addition to judging, there will also be at least two educational sessions by\nNumenta team members Subutai Ahmad and Jeff Hawkins. They will be talking about\nthe history and evolution of HTM algorithms, the Numenta Anomaly Benchmark, and\nsome details about new algorithm development.</p>\n<p>You dont have to participate in the Challenge to attend the onsite event.\nMaybe you just want to come see the latest presentations from Numenta or watch\nthe Challenge demonstration judging. Thats great! We welcome you to mingle with\nus HTM enthusiasts.\n<a href=\"http://www.meetup.com/numenta/events/224711586/\">Register here</a>.</p>\n<p>And as long as youll be in the area, there is a community event being planned\non Friday, November 13, the day before the onsite event. I hope youll come meet\nthe rest of the HTM community. This event is run by the NuPIC community, for the\nNuPIC community. A schedule is in the works.\n<a href=\"http://www.meetup.com/numenta/events/224711563/\">RSVP here</a>.</p>\n<p>Stay tuned for more information on NAB and on the HTM Challenge.  Ill update\nyou as both projects develop.</p>\n<p>Lastly, let me remind you that Avik Partners has now taken over the Grok for IT\nproduct.  They have enhanced the product and are now in\n<a href=\"http://grokstream.com/\">beta</a>. If you want to experience breakthrough anomaly\ndetection on IT infrastructure, register to give it a try.</p>\n"}

