	module.exports = {"author":"Donna Dubinsky","brief":"As I wrote you last month, we have been working hard on creating NAB, the Numenta Anomaly Benchmark, to test the HTM learning algorithms and enable comparison with other algorithms. Now, its here!","date":"2015/11/10","featured":false,"image":"../../../../images/numenta.png","org":"CEO","tags":"numenta anomaly benchmark nab released open source streaming data","title":"Numenta Anomaly Benchmark (NAB) is Released, Open Source with White Paper","body":"<h3>Numenta Newsletter November 2015</h3>\n<h4>Numenta Anomaly Benchmark (NAB) is Released, Open Source with White Paper</h4>\n<p>To Numenta newsletter subscribers:</p>\n<p>As I wrote you last month, we have been working hard on creating NAB, the\nNumenta Anomaly Benchmark, to test the HTM learning algorithms and enable\ncomparison with other algorithms.  Now, its here!</p>\n<p>We have found the need to create a benchmark for many reasons, including:</p>\n<ul>\n<li>\n<p>We sought a benchmark that incorporated time series data, i.e. that gives\ncredit if you find an anomaly earlier rather than later.</p>\n</li>\n<li>\n<p>We wanted a benchmark that incorporated learning  if something about the\nsituation changes, and there is a new normal, does the algorithm keep\nfinding anomalies (false positives), or does it automatically adjust?</p>\n</li>\n<li>\n<p>We wanted real-world data files that have labeled anomalies . did a machine\nfail?  Was it taken off line?  Knowing ground truth is important to evaluate\nwhether an algorithm correctly identifies an anomaly.</p>\n</li>\n<li>\n<p>We wanted an open dataset and code in order for a benchmark to be accepted by\nthe community, it must be accessible to everyone.</p>\n</li>\n<li>\n<p>We saw the need for a new way of scoring.  Scoring can be tricky because you\nneed to think through questions such as:  if you see the anomaly TOO far in\nadvance, perhaps it is not related, and you didnt really spot it . how far\nin advance would that be?</p>\n</li>\n</ul>\n<p>We are now pleased to announce that the <a href=\"http://www.businesswire.com/news/home/20151110006297/en/Numenta-Anomaly-Benchmark-Evaluates-Anomaly-Detection-Techniques\">Numenta Anomaly Benchmark (NAB) is released</a>.\nYou can read the technical paper <t render=\"hbs\"><a href=\"%7B%7Bsite.paths.ext.paper.nab%7D%7D\">here</a></t>.\nThe paper describes our data files, our scoring mechanism, and the test results\nof HTM algorithms along with other, publicly available anomaly detection\nalgorithms.  And, if you want to have a look at the code yourself, it is all in\nopen source.  You can <a href=\"https://github.com/numenta/NAB\">see it here</a>.</p>\n<p>For those readers less interested in technical details, we have created a more\nbusiness focused paper, which you can\n<a href=\"http://numenta.com/assets/pdf/numenta-anomaly-benchmark/NAB-Business-Paper.pdf\">download here</a>.</p>\n<p>Our hope is that we can build a community around NAB.  Wed like to collect\nadditional labeled data files that can be used for future versions.  We expect\nthat others will test their algorithms using our data files and scoring, and\ncompare and publish the results.  Since it is open source, companies can test\ntheir internal algorithms without sharing the results as well, although we hope\nthat they will.   We have received positive feedback from the research community\nso far, and we are confident that NAB will grow over time into a very useful\ntool.</p>\n<p>As a reminder, we will be presenting NAB at two conferences\n(<a href=\"http://mlconf.com/events/san-francisco-ca/\">MLconf SF</a> on November 13 in San\nFrancisco, and the\n<a href=\"http://www.icmla-conference.org/icmla15/\">IEEE Conference on Machine Learning and Applications</a>\non December 9-11 in Miami), so if you are in the vicinity, we hope you will be\nable to attend.</p>\n<p>Im happy to share a couple updates from our strategic partners:\n<a href=\"http://www.grokstream.com/\">Avik Partners</a> and\n<a href=\"http://www.cortical.io/\">Cortical.io</a>. Avik Partners has had a successful beta\nfor Grok for IT and theyre getting ready to launch Grok 2.0.  <a href=\"http://Cortical.io\">Cortical.io</a>\nrecently announced its latest venture capital round of $1.8M and the opening of\nits San Francisco office.  Were excited to see their progress in next\ngeneration natural language processing.</p>\n<p>Lastly, for any of you that are in the Bay Area, wed love to see you at our HTM\nChallenge event this weekend.  If you cant attend in person, you can still help\nchoose the winner.  Public voting for the 12 applications is now open.  Read\nthis blog post to learn more and cast your vote:</p>\n<p><a href=\"http://numenta.org/blog/2015/11/09/vote-for-the-best-htm-challenge-submissions.html\">http://numenta.org/blog/2015/11/09/vote-for-the-best-htm-challenge-submissions.html</a></p>\n"}

