	module.exports = {"author":"Donna Dubinsky","brief":"November is shaping up to be a busy and exciting month for Numenta. I wrote you about the release of our Numenta Anomaly Benchmark (NAB). Today Im pleased to share more good news. Founders Jeff Hawkins and Subutai Ahmad have written a paper that","date":"2015/11/17","featured":false,"image":"../images/image.png","org":"CEO","tags":"numenta machine learning intelligence neurons thousands synapses theory sequence memory neocortex","title":"Why Neurons Have Thousands of Synapses, A Theory of Sequence Memory in Neocortex","body":"<h3>Numenta Newsletter  November 17, 2015</h3>\n<h4>Why Neurons Have Thousands of Synapses, A Theory of Sequence Memory in Neocortex</h4>\n<p>To Numenta newsletter subscribers:</p>\n<p>November is shaping up to be a busy and exciting month for Numenta.\n<a href=\"/newsletters/numenta-anomaly-benchmark-nab-open-source-with-white-paper.html\">Earlier this month</a>,\nI wrote you about the release of our Numenta Anomaly Benchmark (NAB). Today Im\npleased to share more good news.</p>\n<p>Numenta founders Jeff Hawkins and Subutai Ahmad have written a paper that we\nbelieve will become a seminal work in the field of biological and machine\nintelligence. It is titled, Why Neurons Have Thousands of Synapses, A Theory of\nSequence Memory in Neocortex.  We posted the paper to an academic archive a\ncouple of weeks ago. This makes it available while it is undergoing the peer\nreview process.</p>\n<p>MIT Technology Review noticed and wrote a thoughtful article about the paper\nthat explains the concepts and their importance in a very understandable way. We\nthought wed share both the MIT Technology Review article and our paper. If you\nare interested in Numenta, brain theory, and machine intelligence I think you\nwill be interested in reading them.</p>\n<p><strong>MIT Technology Review article:</strong> <br/>\n<a href=\"http://www.technologyreview.com/view/543486/single-artificial-neuron-taught-to-recognize-hundreds-of-patterns/\">http://www.technologyreview.com/view/543486/single-artificial-neuron-taught-to-recognize-hundreds-of-patterns/</a></p>\n<p><strong>Numenta paper:</strong> <br/> <t render=\"hbs\">\n<a href=\"%7B%7Bsite.paths.ext.paper.sequence%7D%7D\">{{site.paths.ext.paper.sequence}}</a>\n</t></p>\n"}

