	module.exports = {"author":"Donna Dubinsky","brief":"As we look forward to a bright 2016 here at Numenta, I thought Id pause and review the highlights of 2015.  From advancing our research to expanding our community, we had many accomplishments that laid the groundwork for significant","date":"2016/01/07","featured":false,"image":"../../../../images/numenta.png","org":"CEO","tags":"numenta 2015 review partners cortical.io avik grok nlp semantic folding nab numenta anomaly benchmark","title":"Year in Review for Numenta 2015","body":"<h3>Numenta Newsletter  January 07, 2016</h3>\n<p>As we look forward to a bright 2016 here at Numenta, I thought Id pause and\nreview the highlights of 2015.  From advancing our research to expanding our\ncommunity, we had many accomplishments that laid the groundwork for significant\nprogress going forward. Id like to share four highlights.</p>\n<ol>\n<li>In 2015, we signed up two key strategic partners:\n<a href=\"http://www.cortical.io/\">Cortical.io</a> and\n<a href=\"http://www.grokstream.com/#home\">Avik Partners</a>.  In May, we\n<a href=\"http://numenta.com/press/numenta-and-cortical-io-form-strategic-partnership.html\">announced our Cortical.io partnership</a>,\nwhich focuses on advancing natural language processing (NLP).  We believe that\nthe combination of our HTM technology and Corticals Semantic Folding\ntechnology provides new possibilities to understanding text.  Co-founder\nFrancisco Webber has been a long-time supporter of Numenta. We look forward to\ncontinued collaboration with him and his team.</li>\n</ol>\n<p>In August, we\n<a href=\"http://numenta.com/press/numenta-announces-licensing-of-grok-for-it-to-avik-partners.html\">announced our partnership with Avik Partners</a>,\nan IT services and advanced analytics startup to whom we transferred our Grok\napplication.  In a short time, Avik CEO Casey Kindiger launched a\n<a href=\"http://www.grokstream.com/#home\">commercial application</a> to use Grok to\nmonitor IT infrastructure. This partnership is a great example of our\ntechnology transfer business model where other companies complete and\ncommercialize our example applications.</p>\n<p>We cant wait to see exciting results from <a href=\"http://Cortical.io\">Cortical.io</a> and Avik Partners, and\nI hope to share news of additional partnerships with you in the coming year.</p>\n<ol start=\"2\">\n<li>\n<p>We also released the\n<a href=\"http://numenta.com/numenta-anomaly-benchmark/\">Numenta Anomaly Benchmark (NAB)</a>,\nwhich was two years in the making.  We believe NAB offers the definitive way\nto assess the performance of algorithms for detecting anomalies in streaming\ndata.  We presented NAB v1.0 at two conferences and continue to get positive\nfeedback supporting the need for this benchmark. The launch was just the\nbeginning for NAB. We are actively working to collect additional data sources\nand publish additional algorithm results to incorporate in the next version.\nStay tuned for details on a NAB competition we are running this year in\nconjunction with the\n<a href=\"http://www.wcci2016.org/programs.php?id=home\">IEEE World Congress on Computational Intelligence</a>.</p>\n</li>\n<li>\n<p>This year also was a great year for our growing <a href=\"http://numenta.org/\">NuPIC</a>\ncommunity, which received a Top 3 ranking in a KDNuggets report on the\n<a href=\"http://www.kdnuggets.com/2015/06/top-20-python-machine-learning-open-source-projects.html\">Top 20 Python Machine Learning Open Source Projects</a>.\nWe increased the number of NuPIC followers by 750, put more of our technology\ninto open source, and had two hackathons that demonstrated the\n<a href=\"http://numenta.com/blog/htm-challenge-2015-results.html\">broad applicability of HTM applications</a>.\nI encourage you to\n<a href=\"https://www.youtube.com/playlist?list=PL3yXMgtrZmDqZc2m7qI3Kkbmxechp2-Zs\">view the videos</a>\nfrom our most recent hackathon.</p>\n</li>\n<li>\n<p>Perhaps one of the most exciting achievements of 2015 was the progress toward\na goal that we set at the beginning of the year: to <a href=\"/papers/\">publish major papers</a> about our work.\nWe have several papers undergoing peer review, which weve  made available\npre-publication on arxiv, an academic archive. I hope to be  sharing news of\npublication over the coming months, but in the meantime, you  can find all our\npapers on arxiv, here:</p>\n</li>\n</ol>\n<ul>\n<li>\n<p><a href=\"http://arxiv.org/abs/1511.00083\">Why Neurons Have Thousands of Synapses, A Theory of Sequence Memory in Neocortex</a>\n(Preprint of journal submission)  Foundational paper describing core HTM\ntheory for sequence memory and its relationship to the neocortex. Written\nwith a neuroscience perspective, the paper explains why neurons need so many\nsynapses and how networks of neurons can form a powerful sequence learning\nmechanism.</p>\n</li>\n<li>\n<p><a href=\"http://arxiv.org/abs/1512.05463\">Continuous online sequence learning with an unsupervised neural network model</a>\n(Preprint of journal submission)  Analysis of HTM sequence memory applied\nto various sequence learning and prediction problems. Written with a machine\nlearning perspective, the paper contains some comparisons to statistical and\nDeep Learning techniques.</p>\n</li>\n<li>\n<p><a href=\"http://arxiv.org/abs/1510.03336\">Evaluating Real-time Anomaly Detection Algorithms</a> -\nthe Numenta Anomaly Benchmark  (Published conference paper)  This paper\ndiscusses how we should think about anomaly detection for streaming\napplications. It introduces a new open-source benchmark for detecting\nanomalies in real-time, time-series data.</p>\n</li>\n<li>\n<p><a href=\"http://arxiv.org/abs/1601.00720\">How do neurons operate on sparse distributed representations? A mathematical theory of sparsity, neurons and active dendrites</a>\n(Preprint of journal submission)  This paper describes a mathematical model\nfor quantifying the benefits and limitations of sparse representations in\nneurons and cortical networks.</p>\n</li>\n<li>\n<p><a href=\"http://arxiv.org/abs/1503.07469\">Properties of Sparse Distributed Representations and their Application to Hierarchical Temporal Memory</a> \nAn earlier version of the above submission, this paper applies our\nmathematical model of sparse representations to practical HTM systems.</p>\n</li>\n<li>\n<p><a href=\"http://arxiv.org/abs/1505.02142\">Porting HTM Models to the Heidelberg Neuromorphic Computing Platform</a> \nRecently there has been much interest in building custom hardware\nimplementations of HTM systems. This paper discusses one such scenario, and\nshows how to port HTM algorithms to analog hardware platforms such as the\none developed by the Human Brain Project.</p>\n</li>\n</ul>\n<p>As we kick off 2016, I am excited for whats in store.  We are working to make\nNumenta technology even more accessible. We have several events and publications\nplanned. And we will remain dedicated to driving the creation of machine\nintelligence through neocortical principles.</p>\n<p>Best wishes for a Happy New Year.</p>\n"}

