	module.exports = {"author":"Christy Maver","brief":"This month, I am pleased to announce the Numenta Anomaly Benchmark competition offered in conjunction with the IEEE WCCI (World Congress on Computational Intelligence). This contest follows the release last fall of our","date":"2016/02/10","featured":false,"image":"../../../../images/numenta.png","org":"Director of Marketing","tags":"numenta anomaly benchmark competition research papers strata hadoop world","title":"Announcing the Numenta Anomaly Benchmark Competition","body":"<h3>Numenta Newsletter  February 10, 2016</h3>\n<p>Im excited to update you on whats happening at Numenta this month, but before\nI do, I want to introduce myself, as some of you may notice a new name at the\nbottom of this newsletter. I joined Numenta as the Director of Marketing last\nfall, and I look forward to keeping you up to date on the latest Numenta news.</p>\n<p>This month, I am pleased to announce the\n<a href=\"http://numenta.org/nab/\">Numenta Anomaly Benchmark competition</a>,\noffered in conjunction with the\n<a href=\"http://www.wcci2016.org/programs.php?id=home\">IEEE WCCI (World Congress on Computational Intelligence)</a>.\nThis contest follows the release last fall of our\n<a href=\"http://numenta.com/numenta-anomaly-benchmark/\">Numenta Anomaly Benchmark</a>,\nwhich is designed to test algorithms that detect anomalies in\nstreaming data and reward early detection.</p>\n<p>The competition provides cash awards for two categories: algorithms and\ndatasets.  In the algorithms category, were looking for others to test and\npublish results of running anomaly detection algorithms on NAB.  For the dataset\ncategory, were looking for real-world, time-series data with labeled anomalies.\nWinning entrants that are participating in the WCCI contest will be announced\nduring official conference proceedings.  We are offering a parallel contest for\nthose who are not able to attend the conference.  Well award cash prizes for\nthe same two categories.  All contest entries are due by July 1, 2016, but we\nencourage you to submit early. For more details on the NAB competition, visit\n<a href=\"http://numenta.org/nab/\">http://numenta.org/nab/</a>. Our intention with NAB is to create a community around\nit and grow it into a widely used tool.  We hope the competition will be a fun\nway to add to the benchmark corpus and to position NAB as the standard benchmark\nfor anomaly detection in streaming data.</p>\n<p>In other news, we recently shared a summary of our published and submitted\nresearch papers.  You can now access all of these papers at\n<a href=\"http://numenta.com/papers/\">http://numenta.com/papers/</a>. I encourage you to bookmark the page as we will be\nupdating it with new material throughout the year.</p>\n<p>Lastly, I want to share that we will be participating in\n<a href=\"http://conferences.oreilly.com/strata/hadoop-big-data-ca\">Strata San Jose</a>,\nMarch 29-31. Well have a booth on the expo floor where you can meet our\nengineers and see our demonstration applications. Well also preview a new tool\nto enable broader experimentation with HTM, so stay tuned for more details.\nIf youre planning on attending Strata, please stop by and see us.</p>\n"}

