	module.exports = {"author":"Christy Maver","brief":"Numenta has an ambitious mission: reverse-engineer the neocortex to understand how it works and apply those principles to software to create intelligent machines.  Because neuroscience is the foundation of everything we do","date":"2016/03/28","featured":false,"image":"../../../../images/numenta.png","org":"Director of Marketing","tags":"numenta neuron paper published peer reviewed neuroscience journal frontiers neural circuits neurons have thousands synapses theory sequence memory","title":"Neuron Paper Published in Peer-reviewed Neuroscience Journal","body":"<h3>Numenta Newsletter  March 28, 2016</h3>\n<p>Numenta has an ambitious mission: reverse-engineer the neocortex to understand\nhow it works and apply those principles to software to create intelligent\nmachines.  Because neuroscience is the foundation of everything we do, its\nimportant to have our work published and critiqued in peer-reviewed neuroscience\njournals.  Im excited to announce that Jeff Hawkins and Subutai Ahmads recent\nmanuscript, <a href=\"http://journal.frontiersin.org/article/10.3389/fncir.2016.00023/abstract\">Why Neurons Have Thousands of Synapses, A Theory of Sequence\nMemory in Neocortex</a>,\nhas been accepted to Frontiers in Neural Circuits Journal, a publication devoted\nto research in neural circuits, serving the worldwide neuroscience community.</p>\n<p>We believe this paper will prove to be a significant contribution to brain\ntheory as well as introduce algorithms that will be important for machine\nintelligence.  The paper proposes a model of cortical neurons that explains why\nthey have thousands of synapses, why the synapses are segregated onto different\nparts of the dendrites, and how neurons integrate this input in a functionally\nmeaningful way.  There are many aspects of this neuron model that are novel.\nThe paper also provides a new and detailed theory of how networks of neurons\nthroughout the neocortex learn sequences and make predictions.</p>\n<p>This theory is radically different than the models used in most artificial\nneural networks such as deep learning and LSTM sequence memory. Deep learning\nand LSTM use artificial neurons that are simplistic and not biologically\naccurate.  Many deep learning models do not incorporate sequence memory at all.\nYet sequence memory is a critical component of the brain.  In fact, we believe\nthat learning and recalling sequences of patterns is the basic operation common\nto all brain function.</p>\n<p>Why is sequence memory so important? Because everything we as humans do is\nsequence based. When we hear someone talk, we take in a sequence of words; when\nwe look at something, our eyes saccade, moving quickly over the image, leading\nto a sequence of inputs from the retina; when we move our bodies, were\noutputting a sequence of motor commands, which causes changes in our inputs. It\nis this understanding of how sequence memory works in the brain that allows our\nsoftware to perform continuous, unsupervised learning without any training data.</p>\n<p>In case you are not familiar with academic publishing, being published in a\njournal like Frontiers is not as simple as writing and submitting your paper.\nIt involves a meticulous, multi-step review process where independent reviewers\nprovide feedback and request changes before accepting or denying the paper.\nThis paper is ambitious in how many new ideas it introduces, and took over a\nyear from when we first decided to write it to now, when it has been accepted.</p>\n<p>I invite you to read <a href=\"http://journal.frontiersin.org/article/10.3389/fncir.2016.00023/abstract\">the paper</a>,\nand for those that want a less technical overview, I encourage you to read\n<a href=\"https://www.technologyreview.com/s/543486/single-artificial-neuron-taught-to-recognize-hundreds-of-patterns/\">this article by MIT Tech Review</a>,\nwhich summarizes the findings of our pre-published version.</p>\n<p>Speaking of papers, we also recently completed a new white paper that addresses\none of the most popular topics that were asked when people are learning about\nNumentas HTM theory: encoders.  The paper, <a href=\"http://arxiv.org/abs/1602.05925\">Encoding Data for HTM Systems</a>,\nwritten by Scott Purdy, our Director of Engineering, describes how to encode\ndata into Sparse Distributed Representations (SDRs) so that the data can be used\nin HTM systems.  Scott reviews several existing encoders, which are available\nthrough our open source project called <a href=\"http://numenta.org\">NuPIC</a>, and explains\nthe requirements for creating encoders for new types of data.</p>\n<p>Lastly, for any of our readers that will be attending <a href=\"/events/strata-hadoop-world-big-data-conference-2016.html\">Strata + Hadoop World\n2016 in San Jose, CA</a>,\nplease stop by and say Hi.  We will be at Booth 540, along with representatives\nfrom our partners <a href=\"http://cortical.io\">Cortical.io</a> and\n<a href=\"http://grokstream.com\">Avik Partners</a>, giving demos and overviews on the\ncompany, our technology and our latest applications.</p>\n"}

