	module.exports = {"author":"Christy Maver","brief":"We receive many requests for better documentation of our work, and as our research has progressed, we know that some of our most popular papers are now outdated. As a result, we have been working for some time on creating a living","date":"2016/05/11","featured":false,"image":"../../../../images/numenta.png","org":"Director of Marketing","tags":"numenta newsletter may 2016 bami biological and machine intelligence living online book machine intelligence htm hierarchical temporal memory","title":"Announcing BAMI: Biological and Machine Intelligence, a Living Online Book","body":"<h3>Numenta Newsletter  May 11, 2016</h3>\n<p>We receive many requests for better documentation of our work, and as our\nresearch has progressed, we know that some of our most popular papers are now\noutdated.  As a result, we have been working for some time on creating a living\nbook, a cohesive body of documentation that provides readers with the A to Z\nof HTM, and that can be updated as our work progresses.  I am pleased to\nannounce that we have released the first four chapters of this book, called\n<a href=\"/biological-and-machine-intelligence/\">Biological and Machine Intelligence (BAMI)</a>. We\nare calling this release v.4 to represent the 4 chapters available. We include a\nlist of future chapters that we hope to add, as well as links to research papers\nand supporting material. Material that is replaced by BAMI will be moved to the\narchive section of the <a href=\"/learn/\">learning center</a> on our web site.</p>\n<p>In addition to publishing peer reviewed papers, we hope to build on BAMI to\nbecome the principal resource for those who want to learn about HTM.  Over time,\nwe will include problem sets and lecture notes, making it particularly\nappropriate for academics who intend to create courses teaching HTM theory.</p>\n<p>For those who are interested, weve created a twitter account called\n<a href=\"https://twitter.com/NumentaBAMI\">@NumentaBAMI</a>, which we will only use for BAMI\nupdates.  If youd like to be alerted when we add or revise a chapter, I\nencourage you to follow this account. Weve designed BAMI such that each chapter\nincludes a revision history, so you will always be able to see what has changed.\nWe hope you find BAMI to be a useful resource, and we\n<a href=\"https://numenta.wufoo.com/forms/biological-and-machine-intelligence-bami/\">welcome your feedback and comments</a>.</p>\n<p>In addition to our BAMI news, we have some exciting events coming up this month\nas well. On May 12, Jeff Hawkins will be the featured guest at a\n<strong><a href=\"http://www.meetup.com/NeuroTechSF/events/230385690/\">NeurotechX meetup in San Francisco</a></strong>.\nCo-founded by one of our engineers, <a href=\"mailto:mleborgne@numenta.com\">Marion LeBorgne</a>,\nNeurotechX is a non-profit organization whose mission is to build a strong,\nglobal neurotechnology community by providing key resources and learning\nopportunities.  Jeff will give a talk titled &quot;What is Intelligence, that a\nMachine Might Have Some?  For those that are not in the Bay Area, you can watch\nthe event live, and ask questions in the chat room.</p>\n<p>On May 19, Subutai Ahmad will be giving a talk titled, Detecting Anomalies in\nStreaming Data  Real-time Algorithms for Real-world Applications at\n<strong><a href=\"http://data.bythebay.io/\">Data By the Bay 2016</a></strong>. Spanning 150 talks over\n5 days, Data By The Bay is a by-data engineers, for-data engineers developer and\ndata scientist conference. If youre interested in attending, you\n<a href=\"https://www.universe.com/embed/listings/BQJX8H/bookings/new?modal=1&amp;discount_code=NUMENTA10\">can get a 10% discount with the code NUMENTA10</a>.</p>\n<p>Also on May 19, I will be speaking at the\n<strong><a href=\"https://theinnovationenterprise.com/summits/business-analytics-innovation-summit-chicago-2016\">Business Analytics Innovation Summit</a></strong>\nin Chicago.  As a sponsor of this event, we will have the opportunity to\nintroduce and demonstrate our technology and its applications to a\nbusiness-focused audience over the course of two days.</p>\n<p>In partner news, <a href=\"http://Cortical.io\">Cortical.io</a> announced new releases to their products, which\ninclude more accurate results in the comparison of text similarity. This\nannouncement comes on the heels of an independent academic study that concluded\n<a href=\"http://Cortical.io\">Cortical.io</a>s Semantic Folding approach helps improve the prediction of stock\nreturn correlations. Visit <a href=\"http://cortical.io\">their website</a> for more details.</p>\n<p>Lastly, our Open Source Flag Bearer, <a href=\"mailto:mtaylor@numenta.com\">Matt Taylor</a>,\nhas created a new YouTube series called\n<a href=\"https://www.youtube.com/playlist?list=PL3yXMgtrZmDqhsFQzwUC9V8MeeVOQ7eZ9\">HTM School</a>.\nDesigned for the layperson, Matt breaks down the basics of various HTM topics in\nbite-size videos.  If you havent been to HTM School, be sure to check it out.</p>\n"}

