	module.exports = {"author":"Christy Maver","brief":"Since I arrived at Numenta 9 months ago, one of the most common requests Ive heard is that people want an easy way to experiment with HTM without having to dive deep into our code and algorithms","date":"2016/06/28","featured":false,"image":"../images/htm-studio.png","org":"Director of Marketing","tags":"numenta releases htm studio desktop application anomaly detection htm school nupic","title":"Numenta Releases HTM Studio Desktop Application","body":"<h3>Numenta Newsletter  June 28, 2016</h3>\n<p>Since I arrived at Numenta 9 months ago, one of the most common requests Ive\nheard is that people want an easy way to experiment with <a href=\"http://numenta.com/#technology\">HTM</a> without having\nto dive deep into our code and algorithms. Well, Im happy to share that this\nweek we addressed that request when we announced the <a href=\"http://www.businesswire.com/news/home/20160627005453/en/Numenta-Releases-HTM-Studio\">release of HTM Studio</a>,\na desktop tool that allows you to test whether HTM finds interesting anomalies\nin your own numeric, time-series data.</p>\n<p>The ability to detect anomalies as soon as possible in streaming data has value\nacross a wide variety of applications  from health monitoring to preventative\nmaintenance to geospatial tracking and more. Yet early detection is easier said\nthan done, and traditional methods like thresholds often miss the subtle\nanomalies common within streaming data. Because HTM learns continuously and\nwithout supervision, it finds these types of anomalies very well.</p>\n<p><a href=\"http://numenta.com/htm-studio/\">HTM Studio</a> provides a way for anyone, even non-technical people, to\nexperiment with HTM for anomaly detection on their own data, without having to\nupload anything to the cloud. After downloading HTM Studio, you can import a\nlocal csv file, and with a few clicks, HTM analyzes your data and displays any\nanomalies it finds.  For those who dont have streaming data sets, HTM Studio\ncomes with pre-loaded sample data.</p>\n<p>We hope that this release encourages broad experimentation with our technology.\nTry it on your home automation data to uncover anomalies in your usage patterns,\nor your sleep data to find abnormalities in your sleep-wake cycles, or your\ncompanys sensors to see where unusual activity is occurring in the office. All\nyou need is a csv file with one Date/Time column, one header row and at least\n400 rows of numeric data listed in chronological order.  For more on how to\nensure your data is in the right format for HTM Studio, watch this\n<a href=\"http://youtu.be/f80ewxLvgks\">short tutorial video</a>.  HTM Studio provides an easy way to do a proof of\nconcept before fully implementing or deploying HTM. It also removes the\ntechnical hurdle and steep learning curve that typically accompanies HTM\nexperimentation.</p>\n<p>As a company with a scientific mission to understand how the brain learns, its\nbeen hard for us to make this technology accessible, which is why we are so\nproud of this release. If youd like to try it, you can download the Windows or\nMac version, view our tutorials and give us feedback at\n<a href=\"http://numenta.com/htm-studio/\">http://numenta.com/htm-studio/</a>.  Feel free to write us about interesting\nanomalies that you find  we hope to share guest blog posts of the best ones.</p>\n<p>While many of you are likely planning summer trips, Numenta will be traveling\nthe globe this summer as well.  Our Research Engineer, <a href=\"mailto:ycui@numenta.com\">Yuwei Cui</a>, just\nreturned from speaking at two academic conferences in Greece (<a href=\"http://numenta.com/events/dendritic-anatomy-molecules-and-function-heraklion-crete.html\">Dendrite</a> and\n<a href=\"http://numenta.com/events/areadne-2016-research-in-encoding-and-decoding-of-neural-ensembles.html\">Areadne</a>), and will be in Vancouver, BC next month to speak at the\n<a href=\"http://numenta.com/events/ieee-wcci-2016.html\">IEEE World Congress on Computational Intelligence</a>. <a href=\"mailto:sahmad@numenta.com\">Subutai Ahmad</a>, VP\nof Research, is headed to speak at the <a href=\"http://numenta.com/events/the-playfair-ai-summit-2016.html\">Playfair AI Summit</a> in London, before\nreturning to speak in San Francisco at the <a href=\"http://numenta.com/events/data-science-summit.html\">Data Science Summit</a>.  Well be\nexhibiting at Data Science Summit as well, so if youre planning to attend, be\nsure to stop by our table for a demo of HTM Studio.</p>\n<p>For those of you who follow our open source project, you may have seen that we\nmigrated our HTM mailing lists to the <a href=\"https://discourse.numenta.org/\">HTM Forum</a>.  With its clean,\nintuitive design, this new forum provides a better platform for fostering\ndiscussions as the community continues to grow. It categorizes content and\nallows you to choose which topics to follow. Moderated by our open source flag\nbearer, <a href=\"mailto:matt@numenta.org\">Matt Taylor</a>, HTM Forum is open to anyone, so I encourage you to\nread the posts and join the conversation at <a href=\"https://discourse.numenta.org/\">https://discourse.numenta.org/</a>.</p>\n<p>In other news, our partners have some exciting updates to share. <a href=\"http://www.grokstream.com/\">Grok</a> has\nmade several product improvements over the past few months. Grok now supports\nworkflow automation, features improvements to the anomaly dashboard and includes\nmany new design enhancements.  As Grok continues to grow, the company is looking\nto expand as well.  If you know anyone who would make a great community manager\nor full stack developer, particularly in the Southern California area, contact\n<a href=\"mailto:tarun@grokstream.com\">tarun@grokstream.com</a>.</p>\n<p><a href=\"http://Cortical.io\">Cortical.io</a> was recently named an IDC Innovator for the\n<a href=\"http://www.cortical.io/news.html#lead_1\">2016 Machine-Learning based Text Analytics market</a>. Much like Numenta,\n<a href=\"http://Cortical.io\">Cortical.io</a> has been traveling the globe and will be speaking at several\nupcoming <a href=\"http://www.cortical.io/company/events/\">events</a>, including the <a href=\"http://conferences.oreilly.com/artificial-intelligence/ai-deep-learning-bots-ny/public/content/about\">AI OReilly Conference</a> in New York\nSeptember 26-27.</p>\n<p>Lastly, we are in the final countdown of our Numenta Anomaly Benchmark (NAB)\ncompetition. This <a href=\"https://youtu.be/Wdr_s9Bdi3I\">short video</a> explains how easy it is to win up to $5,000.</p>\n"}

